INSERT INTO `categories` VALUES (1,'General','general','Chứa các đề thi lẻ không thuộc vào bất cứ danh mục nào',0,'2020-09-22 13:36:03'),(2,'Cisco Certified Network Associate (CCNA)','ccna','Chứng chỉ CCNA (Cisco Certified Network Associate) là một chứng chỉ nghề cơ bản về công nghệ mạng do hãng Cisco System có trụ sở đóng tại Mỹ  cấp và được công nhận trên 150 nước toàn thế giới.',1,'2020-09-22 13:18:50'),(3,'Certified Information Systems Security Professional (CISSP)','cissp','CISSP là một trong số các lựa chọn hàng đầu cho các IT professionals nhằm trang bị thêm các kỹ năng triển khai bảo mật thông tin cho tổ chức.',1,'2020-09-22 13:18:50'),(4,'Hệ điều hành','operating-systems','Liên quan đến quá trình đồng thời, loại trừ tương hỗ và đồng bộ cho các quá trình đồng thời, định thời bộ xử lý, bộ nhớ thực, bộ nhớ ảo, phân đoạn, phân trang, thay thế trang, hệ thống file, journaling, Virtual Machine Monitor, an ninh và bảo vệ.',1,'2020-09-22 16:18:50'),(5,'Pháp luật đại cương','pldc',' Pháp luật đại cương là một môn học có nội dung rất phong phú, môn học nghiên cứu các khái niệm cơ bản, các phạm trù cơ bản nhất về Nhà nước và pháp luật với góc độ khoa học pháp lý.',1,'2020-10-11 18:19:09'),(6,'Tin học văn phòng','tin-hoc-van-phong','Trắc nghiệm tin học văn phòng',1,'2020-11-15 16:41:31');
