INSERT INTO `questions` VALUES (1,2,'A device that can send and receive information, but not at the same time, is ...','A device that can send and receive information, but not at the same time, is said to be ..................','When a device can send and receive information, but not at the same time, it is known as half-duplex communication. Full duplex is when the device can send and receive at the same time.',1,'2020-06-22 14:25:07',3,'2020-06-22 14:25:07',3,1.00000),(2,2,'A group of systems that can have their data collide with one another is known...','A group of systems that can have their data collide with one another is known as a.....................','A collision domain is an area of the network where one system can collide with another system. Each port on a network switch or bridge creates a separate collision domain, whereas all ports on a hub are part of the same collision domain.',1,'2020-06-22 14:25:07',3,'2020-06-22 14:25:07',3,1.00000),(3,2,'A group of systems that can receive one another’s broadcast messages is known...','A group of systems that can receive one another’s broadcast messages is known as a...................','A broadcast domain is a group of systems that can receive one another’s broadcast message. You can break your network into multiple broadcast domains by using routers or VLANs.',1,'2020-06-22 14:25:07',3,'2020-06-22 14:25:07',3,1.00000),(4,2,'A message that is sent out on the network and is destined for a group of ...','A message that is sent out on the network and is destined for a group of systems is known as a ............ message.','Multicast traffic is traffic that is destined for more than one system, but not all systems.',1,'2020-06-22 14:25:07',3,'2020-06-22 14:25:07',3,1.00000),(5,2,'A message that is sent out on the network and is destined for all systems is ...','A message that is sent out on the network and is destined for all systems is known as a .................. message.','A broadcast message is a message sent to all systems on the network. A broadcast message has a destination MAC address of FF-FF-FF-FF-FF-FF.',1,'2020-06-22 14:25:07',3,'2020-06-22 14:25:07',3,1.00000),(6,2,'Define a full mesh topology design.','Define a full mesh topology design.','All links between switches are connected redundantly. This allows for both the forwarding plane and control plane to have multiple paths and redundancy. The forwarding plane forwards traffic, and the control plane controls routing between VLANs.',1,'2020-06-22 14:25:07',3,'2020-06-22 14:25:07',3,1.00000),(7,2,'Define a star topology design.','Define a star topology design.','In a star topology, the central switch is connected outward to all edge switches. This is commonly seen at the core layer switch.',1,'2020-06-22 14:25:07',3,'2020-06-22 14:25:07',3,1.00000),(8,2,'How many broadcast domains and collision domains are there in the diagram below?','How many broadcast domains and collision domains are there in the diagram below?','2 broadcast domains and 5 collision domains. Each port on a switch or bridge creates a separate collision domain, whereas each port on the router creates a separate broadcast domain.',1,'2020-06-22 14:25:07',3,'2020-06-22 14:25:07',3,1.00000),(9,2,'If you had limited cable access for the distribution switches, which topology...','If you had limited cable access for the distribution switches, which topology would you need to plan for?','Generally, office buildings do not have direct runs to each switch closet from the other closets. Although a full mesh is desirable, sometimes only a partial mesh is achievable',1,'2020-06-22 14:25:07',3,'2020-06-22 14:25:07',3,1.00000),(10,2,'What device is responsible for regenerating the signal so that the signal can...','What device is responsible for regenerating the signal so that the signal can travel a greater distance?','A repeater is a layer-1 device that is responsible for regenerating the signal.',1,'2020-06-22 14:25:07',3,'2020-06-22 14:25:07',3,1.00000),(11,2,'What service on the network is responsible for converting the FQDN to an IP ...','What service on the network is responsible for converting the FQDN to an IP address?','DNS is responsible for converting the friendly name, such as www.gleneclarke.com, to an IP address.',1,'2020-06-22 14:25:07',3,'2020-06-22 14:25:07',3,1.00000),(12,2,'What service on the network is responsible for verifying username and ...','What service on the network is responsible for verifying username and passwords when the user attempts to log on?','An authentication server is responsible for verifying the username and passwords of clients wishing to access the network.',1,'2020-06-22 14:25:07',3,'2020-06-22 14:25:07',3,1.00000),(13,2,'When a client system boots up and requests an IP address, it first must send ...','When a client system boots up and requests an IP address, it first must send out which message?','The DHCP discover message is the first message sent out by a DHCP client to locate a DHCP server on the network. The DHCP discover message is a broadcast message which has a destination MAC address of FF-FF-FF-FF-FF-FF.',1,'2020-06-22 14:25:07',3,'2020-06-22 14:25:07',3,1.00000),(14,2,'Where is the full mesh topology commonly seen in the three-tier design model?','Where is the full mesh topology commonly seen in the three-tier design model?','Distribution layer switches are fully meshed for redundancy. The number of links can be calculated with the formula of N(N – 1). So if you had four distribution switches, the ports required for a full mesh would be 4(4 – 1) = 4 × 3 = 12 ports among the four switches. The formula of N (N – 1) / 2 would give you the number of links (connected ports): 4(4 – 1) / 2 = 4 × 3 / 2 = 6 links',1,'2020-06-22 14:25:07',3,'2020-06-22 14:25:07',3,1.00000),(15,2,'Where is the hybrid topology most commonly seen in the three-tier design model?','Where is the hybrid topology most commonly seen in the three-tier design model?','The hybrid topology is most often seen at the access layer. The devices are connected in a star topology and the access layer switches are partially meshed to the distribution layer switches.',1,'2020-06-22 14:25:07',3,'2020-06-22 14:25:07',3,1.00000),(16,2,'Where is the star topology most commonly seen in the three-tier design model?','Where is the star topology most commonly seen in the three-tier design model?','Core layer switches are commonly set up in a star topology. This is because core layer switches connect multiple campuses via distribution layer switches.',1,'2020-06-22 14:25:07',3,'2020-06-22 14:25:07',3,1.00000),(17,2,'Which device filters traffic by looking at the destination address of the ...','Which device filters traffic by looking at the destination address of the frame and then forwards the frame to the port that the destination system resides on?','A switch is a layer-2 device that filters traffic based off the destination MAC address of the frame.',1,'2020-06-22 14:25:07',3,'2020-06-22 14:25:07',3,1.00000),(18,2,'Which is a direct benefit of a full mesh topology?','Which is a direct benefit of a full mesh topology?','Increased redundancy of connections is a direct benefit of a full mesh topology. Although bandwidth will increase because of multiple paths, additional dynamic routing protocols will need to be implemented to achieve this.',1,'2020-06-22 14:25:07',3,'2020-06-22 14:25:07',3,1.00000),(19,2,'Which network service can be configured on your router that is responsible ...','Which network service can be configured on your router that is responsible for assigning IP addresses to systems on the network?','The DHCP service is responsible for assigning IP addresses automatically to systems on the network.',1,'2020-06-22 14:25:07',3,'2020-06-22 14:25:07',3,1.00000),(20,2,'Which network topology design has a centralized switch connecting all of the ...','Which network topology design has a centralized switch connecting all of the devices?','A star topology has a centralized switch connecting all of the devices outward like a star.',1,'2020-06-22 14:25:07',3,'2020-06-22 14:25:07',3,1.00000),(21,2,'Which of the following is a layer-3 device?','Which of the following is a layer-3 device?','A router is an example of a layer-3 device and is responsible for sending or receiving information to and from the network.',1,'2020-06-22 14:25:07',3,'2020-06-22 14:25:07',3,1.00000),(22,2,'Which topology does an autonomous WAP use?','Which topology does an autonomous WAP use?','An autonomous WAP acts similarly to an access layer switch. However, WAPs normally do not have redundant links back to the distribution switches. So it acts more like a star topology, connecting the Ethernet and wireless clients together.',1,'2020-06-22 14:25:07',3,'2020-06-22 14:25:07',3,1.00000),(23,2,'Which topology does the collapsed core layer switch use in a two-tier design ...','Which topology does the collapsed core layer switch use in a two-tier design model?','The collapsed core layer switch uses a star topology connecting outward to the access layer switches. This design is often found in small enterprise and single campus design.',1,'2020-06-22 14:25:07',3,'2020-06-22 14:25:07',3,1.00000),(24,2,'You are monitoring network traffic and notice that there is a large number of...','You are monitoring network traffic and notice that there is a large number of broadcast messages sent across the wire. You would like to separate your network into multiple broadcast domains. How can you do this? (Select two.)','You can use VLANs or a router to break the network into multiple broadcast domains.',2,'2020-06-22 14:25:07',3,'2020-06-22 14:25:07',3,1.00000),(25,2,'You are monitoring network traffic and you notice a number of DHCP discover ...','You are monitoring network traffic and you notice a number of DHCP discover messages on the network. Which of the following is the destination address of the DHCP discover message?','The DHCP discover message is a broadcast message which is used to locate the DHCP server on the network. FF-FF-FF-FF-FF-FF is the layer-2 representation of a broadcast address.',1,'2020-06-22 14:25:07',3,'2020-06-22 14:25:07',3,1.00000),(26,2,'You are troubleshooting a communication problem. You seem to be able to ...','You are troubleshooting a communication problem. You seem to be able to communicate with Glen’s website by IP address, but not by the fully qualified domain name (www.gleneclarke.com). What is most likely the problem?','If you can communicate with a system by the IP address but not the FQDN, it’s a classic indication that the name is not able to resolve to an IP address. This is a sign that there is a problem with the DNS.',1,'2020-06-22 14:25:07',3,'2020-06-22 14:25:07',3,1.00000),(27,2,'Your manager asks you which service is responsible for translating the source...','Your manager asks you which service is responsible for translating the source IP address of a packet to the IP address of the public interface on the router.','NAT is responsible for translating the source IP address of a packet to use the IP of the public interface on the NAT device',1,'2020-06-22 14:25:07',3,'2020-06-22 14:25:07',3,1.00000),(28,2,'How many host bits are needed in order to support 1,010 systems on the network?','How many host bits are needed in order to support 1,010 systems on the network?','The formula to calculate the number of host bits required for a certain number of systems is: 2&lt;sup&gt;host bits&lt;/sup&gt; – 2. So 2&lt;sup&gt;10&lt;/sup&gt; – 2 = 1,024 – 2 = 1,022 This means that with 10 host bits you can support up to 1,022 systems on the network as you have that many valid addresses. Always remember to subtract 2 because you need to take away the addresses reserved for the network ID and the broadcast address.&lt;/p&gt;',1,'2020-06-27 12:13:04',3,'2020-06-27 12:13:04',3,1.00000),(29,2,'How many hosts can exist on a network with the address of 180.45.10.20/20?','How many hosts can exist on a network with the address of 180.45.10.20/20?','With a subnet mask of /20, 12 bits remain for host bits. You can calculate how many hosts are valid with the formula of 2&lt;sup&gt;12&lt;/sup&gt; = 4,096 – 2 = 4,094 valid addresses.',1,'2020-06-27 12:13:04',3,'2020-06-27 12:13:04',3,1.00000),(30,2,'How many hosts can exist on a network with the address of 201.10.20.30/27?','How many hosts can exist on a network with the address of 201.10.20.30/27?','With only 5 host bits remaining in the address, you can have 30 hosts on the network (2&lt;sup&gt;5&lt;/sup&gt; = 32 – 2 = 30 valid IP addresses).',1,'2020-06-27 12:13:04',3,'2020-06-27 12:13:04',3,1.00000),(31,2,'How many masked bits are needed in order to create at least 20 subnets?','How many masked bits are needed in order to create at least 20 subnets?','You need to mask at least 5 bits to create 20 subnets (2&lt;sup&gt;5&lt;/sup&gt; = 32 subnets). If you try to use 4 bits, you do not have enough subnets (2&lt;sup&gt;4&lt;/sup&gt; = 16 subnets).',1,'2020-06-27 12:13:04',3,'2020-06-27 12:13:04',3,1.00000),(32,2,'How many subnet bits do you need to create 6 networks?','How many subnet bits do you need to create 6 networks?','If you were to use only 2 bits to create subnets, you would get 4 of them (2&lt;sup&gt;2&lt;/sup&gt; = 4). Because that is not enough, you need to add one more bit to get 2&lt;sup&gt;3&lt;/sup&gt; = 8 networks! Three subnet bits are used to create between 5 and 8 networks.',1,'2020-06-27 12:13:04',3,'2020-06-27 12:13:04',3,1.00000),(33,2,'*See figure below. You are trying to ping computer B from computer A and are ...','*See figure below. You are trying to ping computer B from computer A and are unsuccessful. What is the problem?','You should use a straight-through cable to connect switches to routers. You use acrossover cable only when connecting similar devices such as a computer to acomputer, a switch to a switch, a router to a router, or a computer to a router.',1,'2020-06-27 12:13:04',3,'2020-06-27 12:13:04',3,1.00000),(34,2,'Sue is having trouble understanding some network concepts and asks you to ...','Sue is having trouble understanding some network concepts and asks you to help identify address types. Which of the following is considered a layer-2 address?','A layer-2 address is the physical address, also known as the MAC addressof the system.',1,'2020-06-27 12:13:04',3,'2020-06-27 12:13:04',3,1.00000),(35,2,'The Fast Ethernet port on a router is assigned the IP address of 131.107.16....','The Fast Ethernet port on a router is assigned the IP address of 131.107.16.1/20. How many hosts can exist on the subnet?','There are 4,094 systems supported on the network. To calculate this, you look at the existing subnet mask in CIDR notation (/20) — meaning 20 bits are used for network bits. You then take that away from the possible 32 bits to calculate the number of host bits and get 12. You then calculate how many hosts (or systems) are supported by using the formula of 2&lt;sup&gt;12&lt;/sup&gt; = 4,096 – 2 = 4,094. (Remember you need to take two away from the 4,096 because two host addresses are always illegal to use for hosts — the network ID and broadcast address.)',1,'2020-06-27 12:13:04',3,'2020-06-27 12:13:04',3,1.00000),(36,2,'What is the minimum number of host bits needed to support 510 hosts on the ...','What is the minimum number of host bits needed to support 510 hosts on the network?','You would need 9 host bits to support 510 hosts on the network (2&lt;sup&gt;9&lt;/sup&gt; = 512 – 2 = 510 addresses).    ',1,'2020-06-27 12:13:04',3,'2020-06-27 12:13:04',3,1.00000),(37,2,'What is the subnet mask of 135.44.33.22/20?','What is the subnet mask of 135.44.33.22/20?','The /20 is the CIDR notation for the number of bits enabled in the subnet mask. Thiscalculates to 255.255.240.0 — which is 11111111.11111111.11110000.00000000 in binary(count the 20 bits set to a 1 value).',1,'2020-06-27 12:13:04',3,'2020-06-27 12:13:04',3,1.00000),(38,2,'What layer of the OSI model is responsible for breaking the data into smaller...','What layer of the OSI model is responsible for breaking the data into smaller segments?','The transport layer is responsible for breaking the data into smaller chunks calledsegments.',1,'2020-06-27 12:13:04',3,'2020-06-27 12:13:04',3,1.00000),(39,2,'What layer of the OSI model is responsible for routing and logical addressing?','What layer of the OSI model is responsible for routing and logical addressing?','The network layer is responsible for logical addressing and routing',1,'2020-06-27 12:13:04',3,'2020-06-27 12:13:04',3,1.00000),(40,2,'What type of cable would you use if you wanted to connect a system to an ...','What type of cable would you use if you wanted to connect a system to an RJ-45 port on a switch?','Straight-through cables are used to connect dissimilar devices such as a computer to aswitch or a router to a switch.',1,'2020-06-27 12:13:04',3,'2020-06-27 12:13:04',3,1.00000),(41,2,'Which of the following are considered layer-1 devices? (Choose two.)','Which of the following are considered layer-1 devices? (Choose two.)','A hub and a repeater are examples of layer-1 devices. Remember that a layer-1 device works with the electrical signal.',2,'2020-06-27 12:13:04',3,'2020-06-27 12:13:04',3,1.00000),(42,2,'Which of the following are considered layer-2 devices? (Choose two.)','Which of the following are considered layer-2 devices? (Choose two.)','Both bridges and switches run at layer 2 and are devices that filter traffic by theMAC address.',2,'2020-06-27 12:13:04',3,'2020-06-27 12:13:04',3,1.00000),(43,2,'Which of the following is considered a layer-3 address?','Which of the following is considered a layer-3 address?','A layer-3 address is a logical address that is assigned to the system. An example of alogical address is an IP address.',1,'2020-06-27 12:13:04',3,'2020-06-27 12:13:04',3,1.00000),(44,2,'Which of the following subnet masks matched to the CIDR notation is correct?','Which of the following subnet masks matched to the CIDR notation is correct?','The subnet mask of 255.255.255.224 would have 27 bits enabled, which wouldcorrespond to /27. The breakdown is shown below:11111111.11111111.11111111.11100000 equals 255. 255. 255. 224',1,'2020-06-27 12:13:04',3,'2020-06-27 12:13:04',3,1.00000),(45,2,'Which option on the Cisco router indicates that you can use the first and ...','Which option on the Cisco router indicates that you can use the first and last subnets of a subnetted network?','The ip subnet-zero command is a default command on today’s Cisco routers, whichallows you to use the first and last subnets when subnetting.',1,'2020-06-27 12:13:04',3,'2020-06-27 12:13:04',3,1.00000),(46,2,'*You are designing a network with subnets of variable sizes. In the figure ...','*You are designing a network with subnets of variable sizes. In the figure below, identify two problems with the design.','In the network diagram, you can see that subnet C requires 22 users but is using a subnet mask of /28. A subnet mask of /28 only allows for 4 host bits, and — 4 host bits calculates to only 14 valid addresses (2&lt;sup&gt;4&lt;/sup&gt; – 2 = 14) for the subnet — not enough addresses to support 22 users. The second problem is that computer A has an IP address in the wrong subnet. The subnet mask of /25 tells you that the network is subnetted because classful IP addresses use /8, /16, or /24. In this case, you are looking at a class C address broken into two subnets. Note that with a /25 you are dealing with one subnet bit that has an increment of 128 — this means the network IDs are 0 and then 128. The network diagram is showing you that the subnet    ID is 202.45.67.0, and therefore all systems on that subnet must be between 1 and 127 (because 128 is the value of the next network ID).',2,'2020-06-27 12:13:04',3,'2020-06-27 12:13:04',3,1.00000),(47,2,'You are designing the IP address scheme for a branch office that needs to ...','You are designing the IP address scheme for a branch office that needs to support 92 systems on the network. What should your subnet mask be?','In order to support 92 systems, you need 7 host bits (2&lt;sup&gt;7&lt;/sup&gt; = 128 – 2 = 126 valid addresses). This means your subnet mask in binary looks like this: 111111111.11111111.111111111.10000000 &lt;br&gt; When you convert this to decimal you get: 255.255.255.128',1,'2020-06-27 12:13:04',3,'2020-06-27 12:13:04',3,1.00000),(48,2,'You are designing the IP address scheme for your network and you need to ...','You are designing the IP address scheme for your network and you need to subnet the 142.65.0.0 network into 12 different networks. What is your new subnet mask?','In order to get support for 12 subnets you would need to subnet with 4 bits (24 = 16 networks). Because you started as a class B (the value of the first octet falls between128 and 191) with a default subnet mask of 255.255.0.0, to add 4 subnet bits you wouldget a new subnet mask of 255.255.240.0. See below:11111111.11111111.11110000.00000000equals255. 255. 240. 0',1,'2020-06-27 12:13:04',3,'2020-06-27 12:13:04',3,1.00000),(49,2,'You are designing the IPv4 address scheme for the network. How do you ...','You are designing the IPv4 address scheme for the network. How do you calculate the broadcast address of a subnet?','In order to calculate the broadcast address of a subnet, you set all host bits to 1 andthen convert to decimal.',1,'2020-06-27 12:13:04',3,'2020-06-27 12:13:04',3,1.00000),(50,2,'You are designing your IPv4 address scheme. How do you calculate the network ...','You are designing your IPv4 address scheme. How do you calculate the network ID of a subnet?','The network ID for a subnet can be calculated by having all host bits set to 0 and thenconverting to decimal.',1,'2020-06-27 12:13:04',3,'2020-06-27 12:13:04',3,1.00000),(51,2,'You are troubleshooting communication to a network by looking at the link ...','You are troubleshooting communication to a network by looking at the link light on the switch. What layer of the OSI model are you troubleshooting when looking at a link light?','The physical layer of the OSI model deals with physical aspects of the network, suchas the cables and connectors. A displayed link light simply means a connection exists.',1,'2020-06-27 12:13:04',3,'2020-06-27 12:13:04',3,1.00000),(52,2,'You need to create a crossover cable. What wires would you cross on one of ...','You need to create a crossover cable. What wires would you cross on one of the ends?','In order to create a crossover cable, you would cross wires 1 and 2 with wires3 and 6 on one of the ends.',1,'2020-06-27 12:13:04',3,'2020-06-27 12:13:04',3,1.00000),(53,2,'You want to assign your serial interface the third valid IP address in the ...','You want to assign your serial interface the third valid IP address in the second subnet of 192.168.2.0/26. Which IP address would you use?','The second subnet is the 192.168.2.64 subnet, with the third valid address being192.168.2.67. Remember that the first address (64) is the network ID, so the first validaddress is 65, then 66, and the third valid address is 67.',1,'2020-06-27 12:13:04',3,'2020-06-27 12:13:04',3,1.00000),(54,2,'You wish to network two systems by connecting a computer directly to another ...','You wish to network two systems by connecting a computer directly to another computer. Which type of cable would you use?','To connect two systems directly together, you use a crossover cable',1,'2020-06-27 12:13:04',3,'2020-06-27 12:13:04',3,1.00000),(55,2,'You wish to subnet 137.15.0.0 in order to support 8,190 hosts on each network...','You wish to subnet 137.15.0.0 in order to support 8,190 hosts on each network. You wish to use the smallest subnet size to support this number of hosts. What will be the new subnet mask?','Because you need to borrow 3 bits from the third octet in order to have each subnetsupport 8,190 hosts, the new subnet mask is 255.255.224.0.',1,'2020-06-27 12:13:04',3,'2020-06-27 12:13:04',3,1.00000),(56,2,'Your manager would like you to subnet the 129.65.0.0 network into six ...','Your manager would like you to subnet the 129.65.0.0 network into six different networks. What is your new subnet mask?','To create six new subnets, you need to actually create eight subnets by borrowingthree bits from the host ID portion of the subnet mask and converting them to subnetbits.',1,'2020-06-27 12:13:04',3,'2020-06-27 12:13:04',3,1.00000),(57,2,'Your system uses the IP address of 145.68.23.45/25. How many systems are ...','Your system uses the IP address of 145.68.23.45/25. How many systems are supported on your network?','There are 126 systems supported on the network. To calculate this you take 2&lt;sup&gt;host bits&lt;/sup&gt;, which for 7 host bits is 128, then take the two illegal addresses (network ID and broadcast addresses) away to get 128 – 2 = 126 hosts on the network.',1,'2020-06-27 12:13:04',3,'2020-06-27 12:13:04',3,1.00000),(58,2,'A network administrator is working with the 195.34.56.0 network, which has ...','A network administrator is working with the 195.34.56.0 network, which has been subnetted into 8 networks. Which of the following two addresses can be assigned to hosts on the same subnet? (Select two.)','In order to create 8 networks, you must use 3 subnet bits (23 = 8). If you were to subnet with 3 bits, you would get this as a new subnet mask in binary (only the relevant portion is in binary): 255.255.255.11100000. Next, you look at the value of the last subnet bit to determine the increment value (32) and then calculate your network IDs: Network 1: 195.34.56.0 Network 2: 195.34.56.32 Network 3: 195.34.56.64 Network 4: 195.34.56.96 Network 5: 195.34.56.128 You then look at all the choices provided in the question and determine which two addresses fall within the same network. Because Network 3 goes from 195.34.56.64 up to 195.34.56.95, it includes the addresses for choices A (195.34.56.35) and D (195.34.56.58). All choices and their networks are listed below — you are looking for two on the same network: A. 195.34.56.35 — Network 2 B. 195.34.56.14 — Network 1 C. 195.34.56.76 — Network 3 D. 195.34.56.58 — Network 2 E. 195.34.56.98 — Network 4 F. 195.34.56.129 — Network 5',2,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(59,2,'The 24.60.32.20/11 address is located in which of the following subnets?','The 24.60.32.20/11 address is located in which of the following subnets?','The 24.60.32.20/11 address is located in the 24.32.0.0 network range. A quick way to figure these questions out is to look at the /11 and ask yourself what the increment value supplied by the last bit used to subnet is. It is 32! This means that the network IDs increment by 32, starting with 24.0.0.0, then 24.32.0.0, and then 24.64.0.0. In this question, the address 24.60.32.20 is less than 24.64.0.0, so it must be on the 24.32.0.0 network.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(60,2,'*Using the network diagram shown in the figure below and having the goal of ...','*Using the network diagram shown in the figure below and having the goal of making the best use of your IP address space, which of the following represents the address scheme you would apply to the Toronto office?','In order to support a network of 27 systems, you need to use 5 host bits (2&lt;sup&gt;5&lt;/sup&gt; = 32 – 2 = 30 hosts). This means that your subnet mask would look like this in binary: 11111111.11111111.11111111.11100000 This can be written in shorthand CIDR notation as /27, meaning that 27 bits are enabled in the subnet mask and used as network bits (whereas the bits set to 0 are host bits).',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(61,2,'What is the application layer protocol for delivering e-mail across the ...','What is the application layer protocol for delivering e-mail across the Internet?','SMTP is the Internet protocol for delivering e-mail, whereas POP3 and IMAP are Internet protocols for receiving e-mail.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(62,2,'What is the application layer protocol for receiving e-mail over the Internet?','What is the application layer protocol for receiving e-mail over the Internet?','POP3 is the Internet protocol for receiving e-mail, whereas SMTP is the Internet protocol for delivering e-mail.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(63,2,'What is the broadcast address of 107.50.100.10/12?','What is the broadcast address of 107.50.100.10/12?','The example address in the question is a class address and by default should use /8 to represent the subnet mask, but this example is using /12 with 4 additional subnet bits, making the subnet mask the /12. The value of the last bit subnetted is 16, which is the increment value. This creates network IDs of 0, 16, 32, 48, 64, etc. So the network IDs are as follows: 107.0.0.0 — Network 1 107.16.0.0 — Network 2 107.32.0.0 — Network 3 107.48.0.0 — Network 4 107.64.0.0 — Network 5 The address in the question falls into network 4, which would have a broadcast address of one less than the next network’s network ID — which is 107.63.255.255.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(64,2,'What is the last valid address for the subnet of 220.55.66.64/27?','What is the last valid address for the subnet of 220.55.66.64/27?','The last valid address of the 64 subnet in this example is 94. An easy way to figure this out is the next network ID would have 96 as a value and the number before that would be the broadcast address (95), which leaves the last valid address to be 94.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(65,2,'What is the network ID for the third subnet of 220.55.66.0/27?','What is the network ID for the third subnet of 220.55.66.0/27?','220.55.66.64 is the network ID of the third subnet. A quick way to figure this out is to determine the increment value of the last bit used to subnet — in this example, it is 32, so the increments are 0, 32, 64, 96, and so on. The third network ID is 64, so you simply add that to 220.55.66.0 to get 220.55.66.64.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(66,2,'What is the network ID of 190.53.159.150/22?','What is the network ID of 190.53.159.150/22?','In this example, a large number of networks is being created because 6 subnet bits are being used. /22 bits minus 16 bits used by default = 6 bits extra are being used. With 6 bits being used, that makes an increment of 4: 255.255.11111100.00000000 Your network IDs are going to increment by 4 starting with: 190.53.0.0 — Network 1 190.53.4.0 — Network 2 190.53.8.0 — Network 3 … continue on to … 190.53.152.0 190.53.156.0 190.53.160.0 The IP address displayed in the question falls before the 190.53.160.0 network, so that means it is part of the 190.53.156.0 network.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(67,2,'When working with a mask that is 22 bits long, which subnet mask is an ...','When working with a mask that is 22 bits long, which subnet mask is an alternate representation of 22 bits?','A mask of 22 bits would be 11111111.11111111.11111100.00000000, or 255.255.252.0.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(68,2,'Which 10 Gigabit Ethernet standard uses multimode fiber-optic cabling?','Which 10 Gigabit Ethernet standard uses multimode fiber-optic cabling?','The 10 Gbps standard that uses multimode fiber-optic cabling is 10GbaseSR. Remember that the S stands for short range, and multimode fiber-optic cabling is used for short distances.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(69,2,'Which Gigabit Ethernet standard uses UTP cabling to reach 1000 Mbps?','Which Gigabit Ethernet standard uses UTP cabling to reach 1000 Mbps?','The Gigabit Ethernet standard that uses UTP cabling is 1000BaseTX.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(70,2,'Which layer of the OSI model works with frames?','Which layer of the OSI model works with frames?','Layer 2 of the OSI model works with frames. This means that devices such as bridges and switches process frames because they are considered layer-2 devices. Note that at layer 3 the data being processed is called a packet because it has a layer-3 header, and at layer 4 the data is known as a segment.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(71,2,'Which layer of the OSI model works with packets?','Which layer of the OSI model works with packets?','When the layer-3 header has been added to the message, the message is known as a packet. Layer-3 devices such as routers process packets.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(72,2,'Which of the following addresses does a router use to determine where a ...','Which of the following addresses does a router use to determine where a packet needs to be delivered? (Choose two.)','Routers use layer-3 addresses to determine where to send a packet.',2,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(73,2,'Which of the following addresses exists on the same network, knowing that all...','Which of the following addresses exists on the same network, knowing that all systems have a subnet mask of 255.255.255.240? (Select two.)','The subnet mask of 255.255.255.240 can be converted to the binary of: 11111111.111111111.111111111.11110000 The value of the last bit is 16, so that becomes the increment for network IDs (0, 16, 32, 48, 64 …). The following lists the networks for each IP in question: A. 195.34.56.7.14 —Network 1 &lt;strong&gt;B. 195.34.56.7.30 — Network 2&lt;/strong&gt; C. 195.34.56.7.38 — Network 3 D. 195.34.56.7. 55 — Network 4 &lt;strong&gt;E. 195.34.56.7.17 — Network &lt;/strong&gt; F. 195.34.56.7.69 — Network 5',2,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(74,2,'Which of the following is the broadcast address of 216.83.25.87/26?','Which of the following is the broadcast address of 216.83.25.87/26?','With a /26, the increment value is 64, so that means that the next network ID is 128 – one number before that is the current network’s broadcast address.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(75,2,'Which of the following is the third valid address of the network containing ...','Which of the following is the third valid address of the network containing 220.19.36.112/27?','/27 means that the increment is 32, so the network ID that the .112 address is in is the 220.19.36.96 – this makes the third valid address of that network, 220.19.36.99.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(76,2,'Which of the following statements are true of 190.88.122.45/19? (Choose three.)','Which of the following statements are true of 190.88.122.45/19? (Choose three.)','The address given is a class B network that has been subnetted (there is a /19 instead of a /16) with 3 subnet bits. Three subnet bits has an increment of 32, so the network IDs for the class B given are: 190.88.0.0 — Network 1 190.88.32.0 — Network 2 190.88.64.0 — Network 3 190.88.96.0 — Network 4 190.88.128.0 — Network 5...and so on. The IP address in the question falls into the range of network 4, which means the first valid address is 190.88.96.1; the broadcast address is 190.88.127.255; and the last valid address is one less than the broadcast, 190.88.127.254.',2,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(77,2,'Which of the following statements are true of 205.56.34.53/28? (Choose three.)','Which of the following statements are true of 205.56.34.53/28? (Choose three.)','In this example, you are dealing with a class C address, so the default subnet mask uses /24. However, this example uses /28. This means that the network has been subnetted with 4 subnet bits. 11111111.11111111.111111111.11110000 The value of the last subnet bit is 16, so you increment the network IDs, giving you 0, 16, 32, 48, 64, etc. The IP address given in the example ends with 53, so you are part of the 48 network: 205.56.34.48 — Network ID 205.56.34.49 — First valid address 205.56.34.62 — Last valid address 205.56.34.63 — Broadcast address',2,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(78,2,'Which of the following subnet masks would you typically use on a WAN ...','Which of the following subnet masks would you typically use on a WAN interface to make the best use of address space?','A WAN link only needs two IP addresses available, so to get two available IP addresses you need 2 host bits (2&lt;sup&gt;2&lt;/sup&gt; =4 – 2 = 2 valid IP addresses). This is your subnet mask in binary: 11111111.11111111.11111111.11111100 This converts to the decimal of 255.255.255.252.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(79,2,'With the goal of preserving addresses, which of the following subnet masks ...','With the goal of preserving addresses, which of the following subnet masks would you use to create a subnet of up to 60 hosts?','You would need 6 host bits to support a minimum of 60 hosts (2&lt;sup&gt;6&lt;/sup&gt; = 64 – 2 = 62 valid IP addresses). This would create the following subnet mask in binary: 11111111.11111111.11111111.11000000 This converts to decimal as 255.255.255.192.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(80,2,'You are designing an IP scheme for a network that will contain up to 8 ...','You are designing an IP scheme for a network that will contain up to 8 subnets with no more than 26 hosts on each. Which of the following subnet masks will be used?','To create eight networks, you would need to use three subnet bits, which would give you a custom subnet mask of 224.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(81,2,'You are testing communication to a router and have decided to connect your ...','You are testing communication to a router and have decided to connect your workstation to the Fast Ethernet port of the router. What type of cable would you use?','This is a strange question because you typically would not do this, but it is on the exam. In this example, the router and workstation are both “hosts” on the network, so you can consider them similar devices; similar devices are connected with a crossover cable.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(82,2,'You have a system whose IP address is correctly configured for 198.45.6.87/27...','You have a system whose IP address is correctly configured for 198.45.6.87/27. You are now responsible for assigning an IP address to the router. Which of the following IP addresses should be assigned to the router?','*This is a tricky question, but one you should get familiar with for the ICND1 and ICND2 exams. The question is giving you an IP address to use as a reference, and you need to choose which IP address exists on the same subnet as the IP address in the question. The first step to figuring out which choice is on the same subnet is to determine how many bits were used to create the subnetted example. In this case, because it is a class C address it should only have a /24 indicating the number of bits enabled in the subnet mask (which is a subnet mask of 255.255.255.0). Because this is a /27, you know that there are 3 additional bits that have been enabled in the subnet mask to create the subnetted example. Step 2 is to look at the value of the last subnet bit that has been enabled and use this as the “increment” value (in this case, it is 32). Once you know the increment value, the third step is to list out all the subnet network IDs and determine which network the IP address given in the question refers to. In this case, the network IDs are 198.45.6.0, 198.45.6.32, 198.45.6.64, 198.45.6.96, 198.45.6.128, etc. The address given is 198.45.6.87, and because .87 falls between .64 and .96 you know that the address is on the 198.45.6.64 network. So the answer to which IP address would you assign must fall between .64 and .95 (it cannot be .96 because that is the next network ID). The answer cannot actually be .64 because it is reserved for the network ID (all host bits set to 0), and it cannot be .95 because that is the broadcast address for .64 network. So you need a number from .65 to .94 — and .94 is the only value in the list of choices that is on that subnet. The figure below shows a visual reference of this explanation. It is critical that you feel comfortable with this method of calculating the answer, because most of the subnetting questions found on the ICND1 and ICND2 exams can be answered quickly using this technique.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(83,2,'You have a UTP cable that has been configured at both ends with the 568B ...','You have a UTP cable that has been configured at both ends with the 568B standard. What type of cable is it?','A straight-through cable is wired the same at both ends of the cable.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(84,2,'You need to assign the fourth valid IP address of 107.53.100.10/12 to the ...','You need to assign the fourth valid IP address of 107.53.100.10/12 to the Fast Ethernet port on the router. What address would you use?','To figure this question out, you must first determine the subnet range. You can do this by looking at the address first and determining that it is a class A address. Then look at the number of bits used in the network ID (/12) and note that it is 4 bits more than a default class A (/8). This means the network is subnetted. Look at the value of the last subnet bit (the 4th bit), which is 16, and that becomes the increment for you to determine the network IDs. The network IDs are: 107.0.0.0/12 &lt;br&gt; 107.16.0.0/12 &lt;br&gt; 107.32.0.0/12 &lt;br&gt; 107.48.0.0/12 &lt;br&gt; 107.64.0.0/12. You then identify where the address in the question falls, and it is between 107.48.0.0 and 107.64.0.0 — this means that the IP address supplied in the question is on the 107.48.0.0 network. Once you identify the network ID, you then count four addresses up from the network ID: 107.48.0.1 107.48.0.2 107.48.0.3 107.48.0.4 —&lt;strong&gt; this is the answer!&lt;/strong&gt;',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(85,2,'You need to assign the last valid IP address of 199.45.67.139/26 to the ...','You need to assign the last valid IP address of 199.45.67.139/26 to the Serial port on your router. What address would you use?','The address in the question is a class C address, so by default it uses /24 for the subnet mask. Since the example uses /26 you know that the network has been subnetted with 2 additional bits in the subnet mask: 11111111.11111111.111111111.11000000 The value of the last bit subnetted is 64, which becomes your increment to calculate the network IDs of 0, 64, 128, and 192. The address in the question ends with 139, an address on the 128 network, which would have a last valid address of 190 (because 191 is the broadcast address in this case).',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(86,2,'You wish to create a crossover cable and have wired one end of the cable with...','You wish to create a crossover cable and have wired one end of the cable with the 568A standard, What standard should you use to wire the opposite end of the cable?','To create a crossover cable, you wire one end of the cable with 568A and the other end of the cable with 568B',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(87,2,'A computer has an IP address of 145.50.23.1/22. What is the broadcast address...','A computer has an IP address of 145.50.23.1/22. What is the broadcast address for that computer?','The network for the computer with an IP address of 145.50.23.1/22 is 145.50.20.0/22. Its valid range is 145.50.20.1 to 145.50.23.254; the broadcast address for the range is 145.50.23.255.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(88,2,'An ISP gives you an IP address of 209.183.160.45/30 to configure your end of ...','An ISP gives you an IP address of 209.183.160.45/30 to configure your end of the serial connection. Which IP address will be on the side at the ISP?','The valid IP address range for 209.183.160.45/30 is 209.183.160.45– 209.183.160.46. Both IP addresses are part of the 209.183.160.44/30 network. 209.183.160.47/30 is the broadcast address for the network.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(89,2,'In the following exhibit, what needs to be changed for Computer A to ...','In the following exhibit, what needs to be changed for Computer A to successfully communicate with Computer B (assume the least amount of effort to fix the problem)?&lt;br/&gt;&lt;img alt=&quot;&quot; src=&quot;/publics/users/images/121833619_1050288695442406_3473228145559719286_n.png&quot; style=&quot;&quot; /&gt;','Computer A’s default gateway address is 192.168.1.63. This address is the broadcast address for the 192.168.1.0/26 network and cannot be used as that network’s gateway.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(90,2,'*In the following exhibit, what needs to be changed for Computer A to ...','&lt;p&gt;*In the following exhibit, what needs to be changed for Computer A to successfully communicate with Computer B (assume the least amount of effort to fix the problem)?&lt;/p&gt;\r\n&lt;p&gt;What needs to be changed for &lt;strong&gt;Computer A&lt;/strong&gt; to successfully communicate with Computer B&lt;/b&gt;','Computer A needs to have its IP address changed to align with the network that its gateway is in. Computer A is in the 192.168.1.32/27 network, while its gateway address is in the 192.168.1.0/27 network. Although changing the gateway address would work, the least amount of effort needs to be done. Changing the gateway address, which is a valid IP address, would create more work for other clients.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(91,2,'What is a major reason to use private IP addressing?','What is a major reason to use private IP addressing?','The private IP address space was created to preserve the number of public IP addresses.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(92,2,'What is required when using private IP addresses to communicate with Internet...','What is required when using private IP addresses to communicate with Internet hosts?','Network Address Translation (NAT) is required to communicate over the Internet with private IP addresses.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(93,2,'What is the CIDR notation for a subnet mask of 255.255.240.0?','What is the CIDR notation for a subnet mask of 255.255.240.0?','The CIDR notation for 255.255.240.0 is /20. The first two subnets are 8 bits (8 × 2 = 16), and the 240 is 4 more bits (16 + 4 = 20).',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(94,2,'What is the maximum distance you can run 1000Base-T?','What is the maximum distance you can run 1000Base-T?','1000Base-T can be run up to 100 meters, or 328 feet, per its specification.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(95,2,'What is the multicast address range?','What is the multicast address range?','The multicast address range is 224.0.0.0 to 239.255.255.255. The /4 depicts a subnet of 16.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(96,2,'What is the terminal specification to connect to a Cisco router or switch via...','What is the terminal specification to connect to a Cisco router or switch via serial cable?','You connect to Cisco switches and routers via 900 baud, 8 data bits, no parity, and 1 stop bit.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(97,2,'What is the valid IP address range for the network of 132.59.34.0/23?','What is the valid IP address range for the network of 132.59.34.0/23?','The valid IP address range for the network of 132.59.34.0/23 is 132.59.34.1 to 132.59.35.254. The first address of 132.59.34.0/23 is the network ID and the last address of 132.59.35.255 is the broadcast ID.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(98,2,'Which address is a multicast IP address?','Which address is a multicast IP address?','The multicast range begins with 224 to 239 in the first octet. Therefore, only the IP address 238.20.80.4 is correct.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(99,2,'Which cable standard delivers 1 Gb/s using four pairs of CAT5e?','Which cable standard delivers 1 Gb/s using four pairs of CAT5e?','1000Base-T is short for 1000 Baseband – Twisted pair. 1000Base-T utilizes all four pairs over standard Cat5e, whereas 100Base-T utilizes only two pairs of Cat5.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(100,2,'Which cable type would you use to connect a router to a switch?','Which cable type would you use to connect a router to a switch?','A straight-through cable would be used since routers are DTE, or data terminal equipment, and switches are DCE, or data communications equipment. DTE to DCE requires a straight-through cable.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(101,2,'Which class is the IP address 172.23.23.2?','Which class is the IP address 172.23.23.2?','The IP address of 172.23.23.2 is a Class B address.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(102,2,'Which fiber optic standard uses a 9 micron core and can span up to 10km?','Which fiber optic standard uses a 9 micron core and can span up to 10km?','Single-mode fiber is 9 microns at its core. With proper transceivers, the signal can span 10 km to 70 km without needing to be retransmitted.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(103,2,'Which is the Class A private IP address range?','Which is the Class A private IP address range?','The Class A private IP address range is defined as 10.0.0.0/8. The address range is 10.0.0.0 to 10.255.255.255.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(104,2,'Which is the Class B private IP address range?','Which is the Class B private IP address range?','The Class B private IP address range is defined as 172.16.0.0/12. The address range is 172.16.0.0 to 172.31.255.255.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(105,2,'Which is the default subnet mask for a Class A address?','Which is the default subnet mask for a Class A address?','The default subnet mask of a Class A address is 255.0.0.0.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(106,2,'Which is true about a layer 3 broadcast?','Which is true about a layer 3 broadcast?','A layer 3 broadcast is always all ones in the host portion of the IP address. When the IP stack see this, it puts all Fs in the destination Ethernet MAC address.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(107,2,'Which is true of an IP address of 135.20.255.255?','Which is true of an IP address of 135.20.255.255?','The IP address 135.20.255.255 is a Class B broadcast address.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(108,2,'Which method is used to direct communications to a group of computers that ...','Which method is used to direct communications to a group of computers that subscribe to the transmission?','Multicast is used to allow computers to opt into a transmission. Examples of uses for multicast are imaging of computers, video, and routing protocols, to name a few.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(109,2,'Which method is used to direct communications to a single host?','Which method is used to direct communications to a single host?','A unicast address is a single valid IP address for direct communications purposes between two hosts.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(110,2,'Which method is used to direct communications to the closest IP address to ...','Which method is used to direct communications to the closest IP address to the source?','Anycast is a way of allowing the same IP address on multiple machines in different geographical areas. The routing protocol is used to advertise in routing tables the closest IP by the use of metrics. Currently this is how DNS root servers work.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(111,2,'Which RFC defines private IP addresses?','Which RFC defines private IP addresses?','RFC 1918 defines three private address ranges, which are not routable on the Internet.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(112,2,'Which subnet does host 131.50.39.23/21 belong to?','Which subnet does host 131.50.39.23/21 belong to?','The /21 subnet mask has subnets in multiples of 8. So the networks would be 131.50.8.0/21 131.50.16.0/21 131.50.32.0/21 and 131.50.40.0/21. The IP address of 131.50.39.23/21 would belong to the 131.50.32.0/21 network with a valid range of 131.50.32.1 to 131.50.39.254.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(113,2,'Which valid IP is in the same network as 192.168.32.61/26?','Which valid IP is in the same network as 192.168.32.61/26?','The valid IP address range for the 192.168.32.0/26 network is 192.168.32.1 to 192.168.32.62, 192.168.32.65 to 192.168.32.126, etc. Therefore, 192.168.32.59 is within the valid IP range of 192.168.32.61/26.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(114,2,'You are setting up a network in which you need 15 routed networks. You have ...','You are setting up a network in which you need 15 routed networks. You have been given a network address of 153.20.0.0, and you need to maximize the number of hosts in each network. Which subnet mask will you use?','The subnet mask will be 255.255.240.0. Since you need to solve for the number of networks, the equation is: 2&lt;sup&gt;x&lt;/sup&gt; is equal to or greater than 15 networks. 2&lt;sup&gt;4&lt;/sup&gt; = 16 completed the equation; the 4 bits represent the subnet side; you add the 4 bits to the 16 bits of the class B subnet mandated by the IETF. 16 + 4 = /20 = 255.255.240.0.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(115,2,'You have been given an IP address network of 203.23.23.0. You are asked to ...','You have been given an IP address network of 203.23.23.0. You are asked to subnet it for two hosts per network. What is the subnet mask you will need to use to maximize networks?','The mask you will need to use is 255.255.255.252. This will allow for two hosts per network for a total of 64 networks. The formula for solving for hosts is: 2&lt;sup&gt;X&lt;/sup&gt; – 2 is equal to or greater than 2 (hosts), which in this case is (2&lt;sup&gt;2&lt;/sup&gt; – 2) = (4 – 2) = 2. So 2 bits are used for the host side, leaving 6 bits for the subnet side. 6 bits + 24 bits (original subnet mask) = /30, or 255.255.255.252.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(116,2,'You have been given an IP address network of 213.43.53.0. You are asked to ...','You have been given an IP address network of 213.43.53.0. You are asked to subnet it for 22 hosts per network. What is the subnet mask you will need to use to maximize networks?','The mask you will need to use is 255.255.255.224. This will allow for 30 hosts per network for a total of eight networks. The formula for solving for hosts is: 2&lt;sup&gt;X&lt;/sup&gt; – 2 is equal to or greater than 22 hosts, which in this case is (2&lt;sup&gt;5&lt;/sup&gt; – 2) = (32 – 2) = 30. So 5 bits are used for the host side, leaving 3 bits for the subnet side. 3 bits + 24 bits (original subnet mask) = /27, or 255.255.255.224.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(117,2,'A computer has an IP address of 192.168.1.6/24, and its gateway address is ...','&lt;p&gt;A computer has an IP address of 192.168.1.6/24, and its gateway address is 192.168.1.1. It is trying to reach a server on an IP address of 127.20.34.4. The server is not responding. What is the problem?&lt;/p&gt;\n','&lt;p&gt;The computer and the gateway address are correct; the IP address of the remote server is wrong. It is a loopback address and can only be internally used by the local computer. The valid range for loopback is 127.0.0.1 to 127.255.255.254.&lt;/p&gt;\n',1,'2020-06-28 11:01:40',3,'2020-11-01 12:19:48',3,1.00000),(118,2,'A computer with an IP address of 172.18.40.5/12 is having trouble getting to ...','A computer with an IP address of 172.18.40.5/12 is having trouble getting to an internal server at an IP address of 172.31.2.4. The default gateway of the computer is 172.16.1.1. What is the problem?','The computer had an IP address of 172.18.40.5/12 and it belongs to the 172.16.0.0/12 network, which has a range of 172.16.0.1 to 172.31.255.254. Therefore, the internal server is within the same network as the computer, and the default gateway has no effect on the problem. The conclusion is that the network is not the problem.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(119,2,'If you had an existing installation of Cat5e on your campus, what is the ...','If you had an existing installation of Cat5e on your campus, what is the highest speed you could run?','Cat5e can support up to 1 Gb/s via the 1000Base-T specification. Since 10BaseT, 100Base-T, and 1000Base-T can be run up to 100 meters in length, it allows for interchangeability with speeds. It was very common when Cat5e came out 16 years ago for installers to future-proof wiring installations with it.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(120,2,'What is the number of subnets which you can have for a mask of 255.255.255.248?','What is the number of subnets which you can have for a mask of 255.255.255.248?','The network mask of 255.255.255.248 borrows 5 bits for the network mask. Using the formula of 2&lt;sup&gt;x&lt;/sup&gt; = subnets, 2&lt;sup&gt;5&lt;/sup&gt; = 32 subnets.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(121,2,'What is the subnet mask for a CIDR notation of /20?','What is the subnet mask for a CIDR notation of /20?','The /20 CIDR notation written out is 255.255.240.0. The first two 8 bits are 255.255, and the last 4 bits make up the subnet mask of 250 to make a complete mask of 255.255.240.0.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(122,2,'What is the valid number of hosts for a network with a subnet mask of 255.255...','What is the valid number of hosts for a network with a subnet mask of 255.255.255.224?','The valid number of hosts for a network with a subnet mask of 255.255.255.224 is 30. If 224 uses 3 bits of the 8 bits available for the network ID, then 5 bits remain for the host portion of the IP address. Using the formula of 2&lt;sup&gt;x&lt;/sup&gt; – 2 = valid hosts, 2&lt;sup&gt;5 &lt;/sup&gt;– 2 = 32 – 2 = 30 valid hosts.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(123,2,'Which cable type would you use to connect a switch to a switch?','Which cable type would you use to connect a switch to a switch?','You would use a crossover cable because a switch is a DCE device. When connecting DCE to DCE, you would need to cross the connection with a crossover cable. Newer switches have MDI-X capabilities to detect the need for a crossover cable and will automatically switch the cable over if a straight-through cable is used.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(124,2,'Which fiber optic standard utilizes a 50 micron core?','Which fiber optic standard utilizes a 50 micron core?','Multi-mode fiber can be either 50 microns or 62.5 microns at its core. The maximum distance for 50 micron fiber is 550 meters utilizing the 1000Base-LX specification.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(125,2,'Which is the Class C private IP address range?','Which is the Class C private IP address range?','Although a Class C address has a classful subnet mask of 255.255.255.0, the private IP address range put aside for Class C addresses is 192.168.0.0 to 192.168.255.255, written in CIDR notation as 192.168.0.0/16.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(126,2,'Which method is used to direct communications to all computers in a subnet?','Which method is used to direct communications to all computers in a subnet?','A broadcast will forward a message to all computers in the same subnet.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(127,2,'Which of the following is an example of a multicast address?','Which of the following is an example of a multicast address?','The multicast address range is 224.0.0.0 to 239.255.255.255.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(128,2,'Which protocol allows multicast switches to join computers to the multicast ...','Which protocol allows multicast switches to join computers to the multicast group?','IGMP, or Internet Group Messaging Protocol, allows switches to join computers to the multicast group table. This allows the selective process of snooping to occur when a transmission is sent.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(129,2,'Which protocol uses broadcasting at layer 3?','Which protocol uses broadcasting at layer 3?','DHCP uses a packet called a Discover packet. This packet is addressed to 255.255.255.255. Although ARP uses a broadcast, it is a layer 2 broadcast, not a layer 3 broadcast.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(130,2,'Which specification for connectivity is currently used in data centers for ...','Which specification for connectivity is currently used in data centers for cost and simplicity?','10GBase-CX is commonly used in data centers. It is referred to by its nickname of Twinax. It is a fixed, balanced coaxial pair that can be run up to 25 meters.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(131,2,'Which type of cable would be used to connect a computer to a switch for ...','Which type of cable would be used to connect a computer to a switch for management of the switch?','Although operation of computers connected to a switch uses a straight-through cable, management via the console port requires a rolled cable and an EIA/TIA 232 adapter.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(132,2,'Who is the governing body that distributes public IP address?','Who is the governing body that distributes public IP address?','IANA, or the Internet Assigned Numbers Authority, is the governing body, which distributes public IP addresses and registers them to ISPs.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(133,2,'You have been given the network of 141.23.64.0/19. What is a valid host in ...','You have been given the network of 141.23.64.0/19. What is a valid host in this network?','The valid IP range for the network of 141.23.64.0/19 is 141.23.64.1 to 141.23.95.254. The IP address of 141.23.90.255/19 is a valid IP address within this range.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(134,2,'You have eight consecutive networks of 132.22.24.0 to 123.22.31.0, which you ...','You have eight consecutive networks of 132.22.24.0 to 123.22.31.0, which you need to super-net together so you can write one ACL in your firewall. What is the super-netted address you will use?','Summarization is similar to subnetting, with the exception that you are grouping IP addresses together. Think of it as reverse subnetting. Since /21 is multiples of 8, the statement of 132.22.24.0/21 would give the following range of IP addresses to be blocked: 132.22.24.1 to 132.22.31.254.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(135,2,'You have four networks of 141.24.4.0, 141.24.5.0, 141.24.6.0, and 141.24.7.0 ...','You have four networks of 141.24.4.0, 141.24.5.0, 141.24.6.0, and 141.24.7.0 that you need to super-net together so you can write one ACL in your firewall. What is the super-netted address you will use?','Summarization is similar to subnetting, with the exception that you are grouping IP addresses together. Think of it as reverse subnetting. Since /22 is multiples of 4, the statement of 141.24.4.0/22 would give the following range of IP addresses to be blocked: 141.24.4.1 to 141.24.7.254.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(136,2,'*You need to use the IP address space of 198.33.20.0/24 and create a VLSM ...','*You need to use the IP address space of 198.33.20.0/24 and create a VLSM subnet scheme for the network in the following exhibit. What is the network ID for Subnet A?','Using the subnet of 198.33.20.0/25 will give you 126 nodes. Since you are using 1 bit of the 8 bits in the 4th octet for the network ID, you have 7 bits left for the hosts. Using the formula of 2&lt;sup&gt;x&lt;/sup&gt; – 2 = valid hosts, 2&lt;sup&gt;7&lt;/sup&gt; – 2 = 128 – 2 = 126 valid hosts.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(137,2,'*You need to use the IP space of 198.33.20.0/24 and create a VLSM subnet ...','*You need to use the IP space of 198.33.20.0/24 and create a VLSM subnet scheme for the network in the following exhibit. What is the network ID for Subnet B?','Using the subnet of 198.33.20.0/26 will give you 62 nodes. Since you are using 2 bits of the 8 bits in the 4th octet for the network ID, you have 6 bits left for the hosts. Using the formula of 2&lt;sup&gt;x&lt;/sup&gt; – 2 = valid hosts, 2&lt;sup&gt;6&lt;/sup&gt; – 2 = 64 – 2 = 62 valid hosts.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(138,2,'*You need to use the IP space of 198.33.20.0/24 and create a VLSM subnet ...','*You need to use the IP space of 198.33.20.0/24 and create a VLSM subnet scheme for the network in the following exhibit. What is the network ID for Subnet C?','Using the subnet of 198.33.20.0/28 will give you 16 nodes. Since you are using 4 bits of the 8 bits in the 4th octet for the network ID, you have 4 bits left for the hosts. Using the formula of &lt;sup&gt;x&lt;/sup&gt; – 2 = valid hosts, 2&lt;sup&gt;4&lt;/sup&gt; – 2 = 16 – 2 = 14 valid hosts.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(139,2,'You plug a laptop into a network jack. When you examine the IP address, you ...','You plug a laptop into a network jack. When you examine the IP address, you see 169.254.23.43. What can you conclude?','Any address in the range of 169.254.0.0/16 is a link-local address. It means that the computer has sensed that a network connection is present, but no DHCP is present. The network only allows local communications and no routing. Microsoft refers to this as an APIPA address.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(140,2,'You plug a laptop into a network jack. When you examine the IP address, you ...','You plug a laptop into a network jack. When you examine the IP address, you see 10.23.2.3. What can you conclude?','The network seems to be configured properly. You have received a valid address in the Class A space of the RFC 1918 private address range.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(141,2,'You want to put a web server online for public use. Which IP address would ...','You want to put a web server online for public use. Which IP address would you use?','198.168.55.45 is a valid IPv4 public address. All of the other addresses are RFC 1918 compliant and thus non-routable on the Internet.',1,'2020-06-28 11:01:40',3,'2020-06-28 11:01:40',3,1.00000),(142,2,'An administrator is checking to make sure that SNMP is working properly. ...','An administrator is checking to make sure that SNMP is working properly. Which is the highest layer checked in the OSI if it is working successfully?','Since SNMP is an application, if it returns back successfully, then we can conclude that the Application layer on the client successfully made a connection to the Application layer on the server.',1,'2020-06-28 11:23:56',3,'2020-06-28 11:23:56',3,1.00000),(143,2,'At which DoD model layer does Telnet, TFTP, SNMP, and SMTP function?','At which DoD model layer does Telnet, TFTP, SNMP, and SMTP function?','Telnet, TFTP, SNMP, and SMTP all function at the Process/Application layer according to the DoD model. The Process/Application layer is a macro layer combining the Application, Presentation, and Session layers of the OSI model.',1,'2020-06-28 11:23:56',3,'2020-06-28 11:23:56',3,1.00000),(144,2,'At which layer of the OSI can you find DTE and DCE interfaces?','At which layer of the OSI can you find DTE and DCE interfaces?','DTE and DCE interfaces are defined at the Physical layer. The original interfaces referred to computers and modems, respectively. However, today the DTE and DCE interfaces define the equipment such as hosts and switches, respectively.',1,'2020-06-28 11:23:56',3,'2020-06-28 11:23:56',3,1.00000),(145,2,'Flow control can be found at which layer of the OSI?','Flow control can be found at which layer of the OSI?','The Transport layer is responsible for flow control via the TCP/IP protocols of TCP and UDP.',1,'2020-06-28 11:23:56',3,'2020-06-28 11:23:56',3,1.00000),(146,2,'The receiving computer checked the checksum of a frame. It had been damaged...','The receiving computer checked the checksum of a frame. It had been damaged during transfer, so it is discarded. At which layer of the OSI did this occur?','The Data Link layer is responsible for checking the FCS, or Frame Checking Sequence, which is a checksum of the frame. This occurs on the MAC sublayer of the Data Link layer.',1,'2020-06-28 11:23:56',3,'2020-06-28 11:23:56',3,1.00000),(147,2,'The translation of ASCII to EBCDIC is performed at which layer of the OSI?','The translation of ASCII to EBCDIC is performed at which layer of the OSI?','The Presentation layer is responsible for translation such as ASCII to EBCDIC. All translation, encryption/decryption, and compression/decompression happens at the Presentation layer.',1,'2020-06-28 11:23:56',3,'2020-06-28 11:23:56',3,1.00000),(148,2,'What is the correct order of encapsulation?','What is the correct order of encapsulation?','The correct order of encapsulation starting with the Application layer is user datagrams, segments, packets, frames, and bits.',1,'2020-06-28 11:23:56',3,'2020-06-28 11:23:56',3,1.00000),(149,2,'When a program uses encryption such as SSL, which layer is responsible?','When a program uses encryption such as SSL, which layer is responsible?','The Presentation layer is responsible for encryption and decryption. Web servers use SSL to encrypt data and the client uses SSL to decrypt the data. SSL processing for both server and client is done at the Presentation layer.',1,'2020-06-28 11:23:56',3,'2020-06-28 11:23:56',3,1.00000),(150,2,'Which access/contention method is used for Ethernet?','Which access/contention method is used for Ethernet?','Carrier Sense Multiple Access/Collision Detection (CSMA/CD) is a contention method that allows multiple devices to share the access media and detect collisions of frames.',1,'2020-06-28 11:23:56',3,'2020-06-28 11:23:56',3,1.00000),(151,2,'Which application provides terminal emulation over a network?','Which application provides terminal emulation over a network?','Telnet is used for terminal emulation over a network to a device expecting terminal emulation, such as a router or switch.',1,'2020-06-28 11:23:56',3,'2020-06-28 11:23:56',3,1.00000),(152,2,'Which device acts like a multiport repeater?','Which device acts like a multiport repeater?','A hub is a multiport repeater. When a hub receives a frame, it will repeat the frame on all other ports, regardless of whether or not the port is the destination host.',1,'2020-06-28 11:23:56',3,'2020-06-28 11:23:56',3,1.00000),(153,2,'Which device will create broadcast domains and raise effective bandwidth?','Which device will create broadcast domains and raise effective bandwidth?','A router will stop broadcasts by default. If you add a router to a flat network, which is a single broadcast domain, you effectively raise bandwidth by reducing the number of broadcasts.',1,'2020-06-28 11:23:56',3,'2020-06-28 11:23:56',3,1.00000),(154,2,'Which device would primarily function at the Data Link layer?','Which device would primarily function at the Data Link layer?','Switches primarily function at the Data Link layer. They inspect frames to direct traffic to the appropriate port by employing source MAC address learning and forward/filter decisions.',1,'2020-06-28 11:23:56',3,'2020-06-28 11:23:56',3,1.00000),(155,2,'Which devices create collision domains, raising effective bandwidth?','Which devices create collision domains, raising effective bandwidth?','Switches create collision domains by isolating the possibility of a collision to the segment it is transmitting to or receiving frames from. This in turn raises effective bandwidth for the rest of the segments.',1,'2020-06-28 11:23:56',3,'2020-06-28 11:23:56',3,1.00000),(156,2,'Which is a correct statement about MAC addresses?','Which is a correct statement about MAC addresses?','When the Individual/Group (I/G) high order bit is set to 1, the frame is a broadcast or a multicast transmission. The OUI assigned by the IEEE is only partially responsible for MAC uniqueness. The vendor is responsible for the last 24 bits of a MAC address.',1,'2020-06-28 11:23:56',3,'2020-06-28 11:23:56',3,1.00000),(157,2,'Which is not a common cause for LAN congestion?','Which is not a common cause for LAN congestion?','Broadcasts, multicasts, and multiple hubs for connectivity are all common causes of LAN congestion. Adding switches for connectivity has no direct relationship to LAN congestion, since switches create collision domains and raise effective bandwidth.',1,'2020-06-28 11:23:56',3,'2020-06-28 11:23:56',3,1.00000),(158,2,'Which is the proper order of the OSI layers?','Which is the proper order of the OSI layers?','A simple way of remembering the order of the OSI layers is with a mnemonic such as All People Seem To Need Drinking Parties or All People Seem To Need Data Processing.',1,'2020-06-28 11:23:56',3,'2020-06-28 11:23:56',3,1.00000),(159,2,'Which layer in the DoD model is responsible for routing?','Which layer in the DoD model is responsible for routing?','The Internet layer of the DoD model maps to the Network layer of the OSI model. The Network layer is where routing occurs.',1,'2020-06-28 11:23:56',3,'2020-06-28 11:23:56',3,1.00000),(160,2,'Which layer is responsible for compression and decompression?','Which layer is responsible for compression and decompression?','The Presentation layer is responsible for compression and decompression. Compression methods can be MP3, JPG, and ZIP, which reduce the number of bits that need to be transmitted over the network. Often web servers use gzip to speed up page delivery. One end compresses and the other end decompresses the data.',1,'2020-06-28 11:23:56',3,'2020-06-28 11:23:56',3,1.00000),(161,2,'Which layer of the OSI defines the PDU, or protocol data unit, of segments?','Which layer of the OSI defines the PDU, or protocol data unit, of segments?','The segment PDU is found at the Transport layer of the OSI. TCP/IP comprises two protocols at this layer: TCP and UDP, which create segments.',1,'2020-06-28 11:23:56',3,'2020-06-28 11:23:56',3,1.00000),(162,2,'Which layer of the OSI is responsible for dialog control of applications?','Which layer of the OSI is responsible for dialog control of applications?','Applications are found in the upper three layers and dialog control is found in the session layer. An example of dialog control is how an application such as instant messaging sends messages with half-duplex conversations like a walkie-talkie.',1,'2020-06-28 11:23:56',3,'2020-06-28 11:23:56',3,1.00000),(163,2,'Which OSI layer is responsible for connection-oriented communication?','Which OSI layer is responsible for connection-oriented communication?','Connection-oriented communication happens at the Transport layer with TCP. TCP uses a three-way handshake to establish a connection. Once it is established, sequences and acknowledgments make sure that data is delivered. Both server and client have a virtual circuit during the establishment.',1,'2020-06-28 11:23:56',3,'2020-06-28 11:23:56',3,1.00000),(164,2,'Which OSI layer is responsible for logical addressing?','Which OSI layer is responsible for logical addressing?','The Network layer is responsible for logical addressing. Routers use logical addressing for path determination to remote networks the same way the post office uses zip codes and street addresses to route mail.',1,'2020-06-28 11:23:56',3,'2020-06-28 11:23:56',3,1.00000),(165,2,'Which protocol is responsible for identifying upper-layer network protocols...','Which protocol is responsible for identifying upper-layer network protocols at the Data Link layer?','Logical Link Control (LLC) is responsible for identifying network protocols at the Data Link layer. This allows the Data Link layer to forward the packet to the appropriate upper-layer protocol.',1,'2020-06-28 11:23:56',3,'2020-06-28 11:23:56',3,1.00000),(166,2,'Which statement is a valid reason the OSI reference model was created?','Which statement is a valid reason the OSI reference model was created?','The OSI reference model was created to divide the network communication process into smaller components for standardization, design, and troubleshooting purposes. It also allows for a nonproprietary standardization of components and prevents a change at one layer from affecting other layers.',1,'2020-06-28 11:23:56',3,'2020-06-28 11:23:56',3,1.00000),(167,2,'Are the systems of 201.45.3.56 and 201.45.5.20 on the same network?','&lt;p&gt;Are the systems of 201.45.3.56 and 201.45.5.20 on the same network?&lt;/p&gt;\n','&lt;p&gt;Because the IP address starts with 201, it means that it is a class C address. Class C addresses use the first three octets as the network ID, so any system on the same network would have the same first three numbers in the IP address.&lt;/p&gt;\n',1,'2020-06-28 14:10:40',3,'2020-11-12 12:33:05',3,1.00000),(168,2,'Are the systems with the IP addresses of 121.56.78.10 and 121.45.6.88 on the ...','Are the systems with the IP addresses of 121.56.78.10 and 121.45.6.88 on the same network?','Looking at the first address, you can see that the value of the first octet is 121, which makes the address a class A address. Class A addresses have the network ID as the first octet, so if another system has the same first octet then it is on the same network.',1,'2020-06-28 14:10:40',3,'2020-06-28 14:10:40',3,1.00000),(169,2,'Bob is unable to surf the Internet and calls you over to his desk to ...','Bob is unable to surf the Internet and calls you over to his desk to troubleshoot. You use &lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;&lt;strong&gt;ipconfig&lt;/strong&gt;&lt;/span&gt; on the system and notice the following IP configuration. What should you do? &lt;br&gt;&lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;&lt;br&gt;&lt;/span&gt;\n&lt;div class=&quot;editor-indent&quot; style=&quot;margin-left: 30px;&quot;&gt;&lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;Local Area Network Connection:&lt;br&gt; &lt;/span&gt;&lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;IPv4 Address…. … .: 192.19.210.79&lt;br&gt; &lt;/span&gt;&lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;Subnet Mask…\n  …. .: 255.255.255.0&lt;br&gt; &lt;/span&gt;&lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;Default Gateway… …: 192.19.0.1&lt;/span&gt;&lt;/div&gt;','In this example, when you look at the IP address and subnet mask you can see that the network ID is 192.19.210.x. The default gateway which references your router must have an IP address within the same network ID.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(170,2,'How many bits are in an IPv6 address?','How many bits are in an IPv6 address?','IPv6 addresses are 128 bits in length, while IPv4 addresses are only 32 bits in length.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(171,2,'Sue is reviewing IP addressing basics and asks you which of the following is ...','Sue is reviewing IP addressing basics and asks you which of the following is considered a class A private address.','Class A private addresses start with 10.0.0.0. Note that class B private addresses range from 172.16.0.0 up to 172.31.255.255. Class C private addresses range from 192.168.0.0 to 192.168.255.255.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(172,2,'Sue is unable to surf the Internet and calls you over to her desk to ...','Sue is unable to surf the Internet and calls you over to her desk to troubleshoot. You use &lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;&lt;strong&gt;ipconfig&lt;/strong&gt;&lt;/span&gt; on the system and notice the following IP configuration. What is the problem? &lt;br&gt;&lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;&lt;br&gt;&lt;/span&gt;\n&lt;div class=&quot;editor-indent&quot; style=&quot;margin-left: 30px;&quot;&gt;&lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;Local Area Network Connection:&lt;br&gt; &lt;/span&gt;&lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;IPv4 Address…. … .: 169.254.34.56&lt;br&gt; &lt;/span&gt;&lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;Subnet\n  Mask… …. .: 255.255.0.0&lt;br&gt; &lt;/span&gt;&lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;Default Gateway… …:&lt;/span&gt;&lt;/div&gt;','Sue’s system has an IP address that starts with 169.254.x.y, which is known as an Automatic Private IP Address (APIPA) address. A system is assigned an APIPA address when it cannot locate a DHCP server to obtain an address from. This is most likely a DHCP problem.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(173,2,'The binary number of 01101101 is which of the following decimal values?','The binary number of 01101101 is which of the following decimal values?','To convert this binary value to decimal, you take the value of each bit set to 1 and add them together (64+32+8+4+1=109).',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(174,2,'The decimal number of 137 is which of the following in binary?','The decimal number of 137 is which of the following in binary?','To convert the decimal number to binary, you would enable the bits that hold the values of 128+8+1=137.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(175,2,'The first 24 bits of the MAC address is known as the ...........','The first 24 bits of the MAC address is known as the ...........','The first half of the MAC address is a unique identifier assigned to the manufacturer of the network card; this is known as the Organizational Unique Identifier (OUI).',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(176,2,'What are the three steps and order of the TCP three-way handshake process?','What are the three steps and order of the TCP three-way handshake process?','The three-way handshake process starts with a Synchronize request (which sets a sequence value for the sender); this is followed by a dual purpose message from the receiver, which acknowledges the sequence value and sets its own sequence value; and this process is finalized by an acknowledgement from the sender of the receiver’s sequence value.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(177,2,'What is the default subnet mask of 130.56.78.10?','What is the default subnet mask of 130.56.78.10?','Because the value of the first octet is 130, this is a class B address. Class B addresses have a default subnet mask of 255.255.0.0.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(178,2,'What is the default subnet mask of a class C address?','What is the default subnet mask of a class C address?','The default subnet mask of a class C address is 255.255.255.0.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(179,2,'What is the default subnet mask of a system with the IP address of 189.34.5.67?','What is the default subnet mask of a system with the IP address of 189.34.5.67?','With 189 as the value of the first octet, this address is a class B address, which has a default subnet mask of 255.255.0.0.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(180,2,'When working with the TCP/IP protocol suite, what protocol makes use of ...','When working with the TCP/IP protocol suite, what protocol makes use of windowing?','TCP makes use of windowing as part of its flow control system, which allows it to ensure that all data arrives completely and in order.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(181,2,'Which class address always has the first two bits of the IP address set to 10?','Which class address always has the first two bits of the IP address set to 10?','Class B addresses always have the first two bits set to 10. This means that class B addresses range from 10000000 (128) to 10111111 (191).',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(182,2,'Which class address always has the value of the first bits in the IP address ...','Which class address always has the value of the first bits in the IP address set to 110?','Class C addresses always have the first three bits set to 110. This means that a class C address ranges from 11000000 (192) to 11011111 (223).',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(183,2,'Which IP address class always has the first bit in the address set to 0?','Which IP address class always has the first bit in the address set to 0?','Class A addresses always have the first bit of the IP address set to 0. This means that class A addresses range from 00000001 (1) to 01111111 (127).',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(184,2,'Which of the following addresses are considered invalid addresses to assign ...','Which of the following addresses are considered invalid addresses to assign to a host on the network?­ (Select all that apply.)','You cannot assign an IP address to a system that has all host bits set to 1s or all host bits set to 0. You also cannot have an IP address where the first octet is 127, which is reserved for loopback.',2,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(185,2,'Which of the following addresses are considered invalid addresses to assign ...','Which of the following addresses are considered invalid addresses to assign to a host on the network?­ (Select all that apply.)','You cannot assign a system an IP address that starts with 127.x.y.z. You also cannot have a system with all host bits set to 1 (which is the case of choice A) or all host bits set to 0 (which is the case of choice D).',2,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(186,2,'Which of the following application layer protocols use TCP as the transport ...','Which of the following application layer protocols use TCP as the transport layer protocol? (Select two.)','SMTP and FTP use TCP as the transport layer protocol. The other protocols use UDP.',2,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(187,2,'Which of the following are considered class A addresses? (Select all that ...','Which of the following are considered class A addresses? (Select all that apply.)','Class A addresses have a value in the first octet that ranges from 1 to 127. Class B addresses have a value in the first octet that ranges from 128 to 191. Class C addresses have a value in the first octet that ranges from 192 to 223.',2,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(188,2,'Which of the following are considered private IP addresses? (Select two.)','Which of the following are considered private IP addresses? (Select two.)','Private addresses are IP addresses that are not routable on the Internet. The following are the private IP address ranges: - 10.0.0.1 to 10.255.255.255 - 172.16.0.0 to 172.31.255.255 - 192.168.0.0 to 192.168.255.255',2,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(189,2,'Which of the following IPv6 addresses is the equivalent to the 127.0.0.1 IPv4...','Which of the following IPv6 addresses is the equivalent to the 127.0.0.1 IPv4 address? (Select two.)','The IPv6 loopback address is known as 0000:0000:0000:0000:0000:0000:0000:0001, or can be abbreviated as ::1.',2,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(190,2,'Which of the following IPv6 communication methods is best known as “...','Which of the following IPv6 communication methods is best known as “1-to-nearest”?','Anycast addressing involves sending the information to the closest device that can service the request.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(191,2,'Which of the following is a class B private address?','Which of the following is a class B private address?','Class B private addresses range from 172.16.0.0 up to 172.31.255.255. Note that class A private addresses start with 10.0.0.0 and class C private addresses range from 192.168.0.0 to 192.168.255.255.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(192,2,'Which of the following is a valid IPv6 address?','Which of the following is a valid IPv6 address?','Each character of the IPv6 address can be a value from 0 to 9 or A to F. Any other characters are illegal. Also, there are eight sections to the IPv6 address and you can replace any sections with 0000 that are side by side with a ::, but only once in the address.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(193,2,'Which of the following statements are true about the UDP protocol? (Select two.)','Which of the following statements are true about the UDP protocol? (Select two.)','UDP is a best effort delivery protocol; as such, data is not guaranteed to arrive in order, or even arrive at all. Each data packet that travels via UDP is treated individually',2,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(194,2,'Which TCP/IP protocol is responsible for reliable delivery?','Which TCP/IP protocol is responsible for reliable delivery?','The TCP protocol is responsible for reliable delivery. It does this by using sequence numbers and acknowledgement numbers.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(195,2,'Your manager has asked about the new IPv6 address format. He asks which of ...','Your manager has asked about the new IPv6 address format. He asks which of the following addresses is a link-local address. What is your answer?','You can always identify link local addresses because they start with FE80.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(196,2,'Your system has an IP address of 131.107.45.10. Which of the following ...','Your system has an IP address of 131.107.45.10. Which of the following systems is on the same network as you?','Because the value of the first octet is 131, it means this system is using a class B address. Class B addresses use 255.255.0.0 as a subnet mask, which means that the first two octets make up the network ID and the last two octets are the host ID. Any system that is going to be on the same network as this system would have to have the first two octets of 131.107.x.y since that is the network ID.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(197,2,'FTP uses which of the following ports?','FTP uses which of the following ports?','FTP uses TCP ports 21 (to transfer FTP commands) and 20 (to transfer data). Note that SMTP uses TCP port 25, telnet uses TCP port 23, and DNS uses TCP 53 (for zone transfers) and UDP 53 (for DNS queries).',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(198,2,'How does TCP guarantee delivery of segments to the receiver?','How does TCP guarantee delivery of segments to the receiver?','TCP guarantees delivery of segments with sequence and acknowledgment numbers. At the Transport layer, each segment is given a sequence number that is acknowledged by the receiver.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(199,2,'SMTP uses which of the following ports?','SMTP uses which of the following ports?','SMTP is the Internet protocol for sending e-mail and uses TCP port 25.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(200,2,'The ARP request is sent to which of the following layer-2 destination ...','The ARP request is sent to which of the following layer-2 destination addresses?','The ARP request message is a broadcast message and is therefore destined for the broadcast address of FF-FF-FF-FF-FF-FF.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(201,2,'The router looks at which field in the IP header to decide where to send ...','The router looks at which field in the IP header to decide where to send the packet?','When a router receives a packet, it compares the destination IP address in the IP header against the routing table to determine where to send the packet.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(202,2,'The security administrator for your network has asked that you block ping...','The security administrator for your network has asked that you block ping messages from entering­your network. What protocol would you block?','ICMP is the protocol used by the ping command, so to block pings you need to block ICMP.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(203,2,'What are the three phases of the TCP three-way handshake?','What are the three phases of the TCP three-way handshake?','The TCP three-way handshake starts with a SYN message from computer A to computer B. Computer B then sends an ACK/SYN message, which is then followed by computer A sending an ACK.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(204,2,'What flags are set on the second phase of the three-way handshake?','What flags are set on the second phase of the three-way handshake?','The second phase of the TCP three-way handshake is ACK/SYN, which is a system acknowledging it has received the other system’s SYN message but at the same time sending its own SYN message.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(205,2,'What ICMP type is used by the echo reply message?','What ICMP type is used by the echo reply message?','The echo reply message uses ICMP type 0. Note that echo request messages use ICMP type 8.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(206,2,'What is required before TCP can begin sending segments?','What is required before TCP can begin sending segments?','A three-way handshake is required between sender and receiver before TCP can begin sending traffic. During this three-way handshake, the sender’s window buffer size is synchronized with the receiver’s window buffer size.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(207,2,'What TCP/IP protocol is responsible for logical addressing and routing ...','What TCP/IP protocol is responsible for logical addressing and routing functions?','The Internet Protocol (IP) protocol is responsible for logical addressing and routing functions. The IP protocol runs at the network layer.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(208,2,'When a programmer decides to use UDP as a transport protocol, what is a ...','When a programmer decides to use UDP as a transport protocol, what is a decision factor?','When a programmer decides to use UDP, it is normally because the programmer is sequencing and acknowledging datagrams already. The redundancy of acknowledgments at the Transport layer is not needed.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(209,2,'Which flag is set in a TCP packet that indicates a previous packet was ...','Which flag is set in a TCP packet that indicates a previous packet was received?','The acknowledgement flag (ACK) is set on a packet to indicate that the message is confirming a previous packet has been received.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(210,2,'Which is a correct statement about sliding windows used with TCP?','Which is a correct statement about sliding windows used with TCP?','The window size, which is a buffer, is established and agreed upon by the sender and receiver during the three-way handshake.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(211,2,'Which is a correct statement about the Transmission Control Protocol (TCP)?','Which is a correct statement about the Transmission Control Protocol (TCP)?','TCP is a connection-based protocol via the three-way handshake. It is not faster than UDP. However, it allows for the retransmission of lost segments because of sequences and acknowledgments.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(212,2,'Which mechanism allows for programs running on a server (daemons) to listen...','Which mechanism allows for programs running on a server (daemons) to listen for requests through the process called binding?','When a daemon or server process starts, it binds to a port number on which to listen for a request. An example is when a web server binds to the port number of TCP/80.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(213,2,'Which of the following are considered application layer protocols?','Which of the following are considered application layer protocols?','FTP is an example of an application layer protocol. IP and ICMP are network layer protocols, whereas TCP is a transport layer protocol. For the CCNA exams, you must know the layers of the OSI model and what protocols run at those layers.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(214,2,'Which of the following are fields found in the IP header? (Select all ...','Which of the following are fields found in the IP header? (Select all that apply.)','The IP header contains information used by the IP protocol. Things such as the source and destination IP address, along with the TTL, are stored in the IP header. Source and destination port information are stored in the TCP or UDP header, and sequence numbers and acknowledgements are stored in the TCP header.',2,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(215,2,'Which of the following are true statements about ports? (Select all that ...','Which of the following are true statements about ports? (Select all that apply.)','DHCP uses UDP ports 67 and 68, SNMP uses UDP port 161, and DNS uses UDP port 53.',2,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(216,2,'Which of the following are true statements about TCP ports? (Select all ...','Which of the following are true statements about TCP ports? (Select all that apply.)','You must know your ports for CCNA exams. FTP uses TCP ports 21 and 20, HTTP uses TCP port 80, and SMTP uses TCP port 25.',2,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(217,2,'Which of the following does TCP use to guarantee delivery?','Which of the following does TCP use to guarantee delivery?','TCP assigns each message (known as a segment) a sequence number. When a message is received at the destination, it sends an acknowledgement based on the received sequence number indicating that the message has been received.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(218,2,'Which of the following represents the port used by POP3?','Which of the following represents the port used by POP3?','POP3 uses TCP port 110. Note that FTP uses TCP 21 and 20, IMAP uses TCP 143, and HTTPS uses TCP 443.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(219,2,'Which protocol and port number is associated with SMTP?','Which protocol and port number is associated with SMTP?','The Simple Mail Transfer Protocol (SMTP) uses TCP port 25 to send mail.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(220,2,'Which protocol is responsible for converting the logical address to a ...','Which protocol is responsible for converting the logical address to a physical address?','Address Resolution Protocol (ARP) is a network layer protocol that converts the IP address ( logical address) to a MAC address (physical address).',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(221,2,'Which protocol requires the programmer to deal with lost segments?','Which protocol requires the programmer to deal with lost segments?','User Datagram Protocol (UDP) does not guarantee segments are delivered. Therefore, the programmer must account for segments that are never received or out of order.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(222,2,'Which statement correctly describes what happens when a web browser ...','Which statement correctly describes what happens when a web browser initiates a request to a web server?','The sender allocates a port dynamically above 1024 and associates it with the request through a process called a handle. This way if a web browser creates three requests for three different web pages, the pages are loaded to their respective windows.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(223,2,'Which TCP flag is responsible for dropping a connection at any point in ...','Which TCP flag is responsible for dropping a connection at any point in time?','A reset flag (RST) is used to drop the TCP connection at any time.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(224,2,'Which TCP/IP protocol is responsible for error and status reporting?','Which TCP/IP protocol is responsible for error and status reporting?','Internet Control Message Protocol (ICMP) is responsible for error and status reporting and runs at the network layer of the OSI model.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(225,2,'Which transport layer protocol is responsible for reliable delivery?','Which transport layer protocol is responsible for reliable delivery?','TCP is responsible for reliable delivery. Note that UDP is a transport layer protocol but it is used for unreliable delivery',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(226,2,'Which transport layer protocol is responsible for unreliable delivery?','Which transport layer protocol is responsible for unreliable delivery?','User Datagram Protocol (UDP) is responsible for unreliable delivery, which means it does not track whether the data has been received at the destination.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(227,2,'Why does DNS use UDP?','Why does DNS use UDP?','DNS requests are usually small and do not require the overhead of sequence and acknowledgment of TCP. If a segment is dropped, the DNS protocol will ask again.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(228,2,'You wish to allow echo request messages to pass through the firewall. ...','You wish to allow echo request messages to pass through the firewall. What ICMP type is used in an echo request message?','ICMP type 8 is used for echo requests, whereas echo reply messages are ICMP type 0',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(229,2,'The external CSU/DSU connects to which port on the router?','The external CSU/DSU connects to which port on the router?','The serial port is used to connect to a WAN environment and is typically connected to an external CSU/DSU if you do not have an integrated CSU/DSU in the router.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(230,2,'Under what conditions would the initial configuration dialog appear?','Under what conditions would the initial configuration dialog appear?','The initial configuration dialog, also known as the setup mode, displays when a Cisco device starts up and there is no startup configuration file. The initial configuration dialog also appears when you type the setup command.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(231,2,'What command would you use to navigate from priv exec mode to user exec ...','What command would you use to navigate from priv exec mode to user exec mode?','The &lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;&lt;strong&gt;disable&lt;/strong&gt;&lt;/span&gt; command is used to move from priv exec mode to user exec mode.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(232,2,'What command would you use to navigate to global configuration mode?','What command would you use to navigate to global configuration mode?','Once in priv exec mode, you can type the &lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;&lt;strong&gt;config terminal&lt;/strong&gt;&lt;/span&gt; command to navigate to global configuration mode.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(233,2,'What happens when a router starts up and it does not have a startup ...','What happens when a router starts up and it does not have a startup configuration file?','When the router cannot find the startup configuration, it prompts you to enter setup mode, also known as the initial configuration dialog. This will then walk you through the basic configuration of a Cisco router without you needing to know the commands.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(234,2,'What is the command to move to priv exec mode from user exec?','What is the command to move to priv exec mode from user exec?','In order to move to priv exec mode, you use the&lt;strong&gt; &lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;enable&lt;/span&gt;&lt;/strong&gt; command from user exec mode.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(235,2,'What is the default router name if a name is not assigned to the router ...','What is the default router name if a name is not assigned to the router during initial configuration?','The default configuration applied to a new router will have the name router if a name has not been configured.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(236,2,'What is the purpose of the POST?','What is the purpose of the POST?','The POST is the first step performed in the boot process and is responsible for verifying that the hardware is functioning.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(237,2,'What type of cable is used to connect to the console port?','What type of cable is used to connect to the console port?','The rollover cable, also known as a console cable, is used to connect a system to the console port.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(238,2,'What type of memory is shown here?','*What type of memory is shown here?','Flash memory holds the Cisco IOS and is typically added to the device with a flash memory card, as shown in the figure.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(239,2,'What type of module can be purchased to install an internal CSU/DSU into...','What type of module can be purchased to install an internal CSU/DSU into the router?','You can purchase a Wan Interface Card (WIC) and install that in the router to add different ports to your router.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(240,2,'What types of actions can an administrator perform at this IOS prompt? ...','What types of actions can an administrator perform at this IOS prompt? (Select two.)&lt;br&gt;&lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;&lt;strong&gt;R1(config-if)#&lt;/strong&gt;&lt;/span&gt;','When you are at an interface prompt&lt;strong&gt; &lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;(config-if#)&lt;/span&gt;&lt;/strong&gt; you can execute commands that apply to the interface, such as disabling the interface or assigning an IP address.',2,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(241,2,'When the Cisco router starts up, where does it find the Cisco IOS?','When the Cisco router starts up, where does it find the Cisco IOS?','The IOS image file is stored in flash memory and is loaded from flash memory into RAM during the bootup process.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(242,2,'When you first boot up the Cisco router, where does it locate the ...','When you first boot up the Cisco router, where does it locate the startup configuration?','The startup configuration is stored in permanent memory known as nonvolatile RAM (NVRAM).',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(243,2,'Where is the running configuration stored?','Where is the running configuration stored?','The running configuration is stored in volatile RAM (VRAM).',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(244,2,'Which commands can you use to save the running configuration to the ...','Which commands can you use to save the running configuration to the startup configuration? (Select two.)','In order to save the running configuration to more permanent memory, use the &lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;&lt;strong&gt;copy running-config startup-config&lt;/strong&gt;&lt;/span&gt; command or the &lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;&lt;strong&gt;write&lt;/strong&gt;&lt;/span&gt; command.',2,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(245,2,'Which of the following are stored in ROM on the Cisco device?','Which of the following are stored in ROM on the Cisco device?','ROM memory on a Cisco device is used to store the Power On Self Test (POST) routines, the bootstrap program, and the ROMMON.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(246,2,'Which of the following port identifiers are used to reference a Fast ...','Which of the following port identifiers are used to reference a Fast Ethernet port? (Select two.)','When working on a router or switch, you can refer to a Fast Ethernet port by using an interface ID such as f0/0 or fa0/0.',2,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(247,2,'Which of the following prompts represents global configuration mode?','Which of the following prompts represents global configuration mode?','Global configuration mode is identified with &lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;&lt;strong&gt;(config)#&lt;/strong&gt;&lt;/span&gt; in the prompt.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(248,2,'Which of the following represents a purpose for the serial port on a ...','Which of the following represents a purpose for the serial port on a Cisco router?','The serial port is typically used to connect to the WAN environment with an external CSU/DSU. You could also use the serial port to connect directly to the serial port of another router for a back-to-back serial link.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(249,2,'You are at the global configuration prompt and wish to configure a ...','You are at the global configuration prompt and wish to configure a communication protocol for remote access to the router. What command would you type?','In order to configure remote access to the router, you will need to configure the telnet ports on the router. You can navigate to the telnet ports with the &lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;&lt;strong&gt;line vty 0 x&lt;/strong&gt;&lt;/span&gt; command, where &lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;&lt;em&gt;&lt;strong&gt;x&lt;/strong&gt;&lt;/em&gt;&lt;/span&gt; is the last telnet port supported by your device.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(250,2,'You are configuring the DCE end of a point-to-point serial link between ...','You are configuring the DCE end of a point-to-point serial link between two routers. What extra command is typed on the DCE end of the link?','The &lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;&lt;strong&gt;clock rate&lt;/strong&gt;&lt;/span&gt; command should be configured on the DCE end of a point-to-point serial link. Note that if you are connecting your serial port to the ISP, then they are the DCE end of the communication channel and will configure the clock rate.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(251,2,'You are connected to your switch and wish to remotely administer the ...','You are connected to your switch and wish to remotely administer the Cisco router. Which com-mand would you use?','You use the &lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;&lt;strong&gt;telnet&lt;/strong&gt;&lt;/span&gt; command to remotely connect to another switch or router for remote administration on that device',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(252,2,'You are performing a security audit on the network devices and have ...','You are performing a security audit on the network devices and have verified that the console port has a password configured. What other port should you verify has a password?','The AUX port should be configured with a password. If it is not, then it is possible that someone with a local access to your router can connect directly to the AUX port and bypass the security you placed on the console port.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(253,2,'You are trying to assign an IP address to the LAN port on the router and...','You are trying to assign an IP address to the LAN port on the router and get the following message on the screen. &lt;br&gt;&lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;Router(config)#interface e0&lt;br&gt;&lt;/span&gt;&lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;^&lt;br&gt; &lt;/span&gt;&lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;% Invalid input detected at ‘^’ marker.&lt;/span&gt;. You use the show version command to try to identify the problem. The output is dis-played below. What is the problem? &lt;br&gt;&lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;Cisco 2811 (MPC860) processor (revision 0x200) with 60416K/5120K bytes of memory&lt;br&gt; &lt;/span&gt;&lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;Processor board ID JAD05190MTZ (4292891495)&lt;br&gt; &lt;/span&gt;&lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;M860 processor: part number 0, mask 49&lt;br&gt; &lt;/span&gt;&lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;2 FastEthernet/IEEE 802.3 interface(s)&lt;br&gt; &lt;/span&gt;&lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;4 Low-speed serial(sync/async) network interface(s)&lt;br&gt; &lt;/span&gt;&lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;239K bytes of NVRAM&lt;br&gt; &lt;/span&gt;&lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;62720K bytes of processor board System flash (Read/Write)&lt;br&gt;&lt;/span&gt;&lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;Configuration register is 0x2102 Router&amp;gt;&lt;/span&gt; This means:','Using the interface ID of “e” means you are referencing an Ethernet port (which is a 10 Mbps port). In this example, Fast Ethernet ports run at 100 Mbps and should be referenced with the ID of “f” or “Fa.”',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(254,2,'You have connected a computer to the console port of a brand new router....','You have connected a computer to the console port of a brand new router. What will the router display on the screen after it is powered on?','A brand new router does not have a startup configuration, so it will ask you to enter the initial configuration dialog so that you can configure the router.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(255,2,'You have rebooted your Cisco switch and it displays an amber light on ...','You have rebooted your Cisco switch and it displays an amber light on the system LED during POST. What does this indicate?','When the system LED is displaying an amber light it means that the device had a failure during POST and is not operating properly.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(256,2,'You wish to get help on which parameters exist on the ping command. How ...','You wish to get help on which parameters exist on the ping command. How would you get a list of parameters?','You can use the &lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;&lt;strong&gt;?&lt;/strong&gt;&lt;/span&gt; to get help from the Cisco IOS. If you use &lt;span style=&quot;font-family:\'Courier New\';font-size:12pt&quot;&gt;&lt;strong&gt;?&lt;/strong&gt;&lt;/span&gt; by itself you will get a list of available commands, and if you use it after the command you get a list of parameters.   ',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(257,2,'You wish to run the initial configuration dialog. What command would you...','You wish to run the initial configuration dialog. What command would you use?','The initial configuration dialog, also known as the setup mode, can be launched at any time by typing the setup command.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(258,2,'Your manager notices an AUX port on the back of the Cisco router and ...','Your manager notices an AUX port on the back of the Cisco router and asks what it is used for. How would you reply?','The AUX port is used to connect a modem to the router. This modem can be used as a method to remotely connect to the router and fix any problems with the configuration.',1,'2020-07-01 11:19:11',3,'2020-07-01 11:19:11',3,1.00000),(259,5,'Nhà nước nào dưới đây là nhà nước đơn nhất?','Nhà nước nào dưới đây là nhà nước đơn nhất?',NULL,1,'2020-07-15 13:17:19',3,'2020-07-15 13:17:19',3,1.00000),(260,5,'Quyền lực của Vua trong hình thức chính thể quân chủ tuyệt đối luôn:','Quyền lực của Vua trong hình thức chính thể quân chủ tuyệt đối luôn:',NULL,1,'2020-07-15 13:17:19',3,'2020-07-15 13:17:19',3,1.00000),(261,5,'Hình thức chính thể quân chủ hạn chế 