ớ gì?','&lt;p&gt;RAM v&amp;agrave; ROM l&amp;agrave; bộ nhớ g&amp;igrave;?&lt;/p&gt;\r\n','&lt;p&gt;RAM v&amp;agrave; ROM l&amp;agrave;&amp;nbsp;Primary memory&lt;/p&gt;\r\n',1,'2020-11-01 13:25:28',33,NULL,NULL,1.00000),(701,1,'Các thiết bị nào dùng để cung cấp dữ liệu cho máy xử lý?','&lt;p&gt;C&amp;aacute;c thiết bị n&amp;agrave;o d&amp;ugrave;ng để cung cấp dữ liệu cho m&amp;aacute;y xử l&amp;yacute;?&lt;/p&gt;\r\n','&lt;p&gt;B&amp;agrave;n ph&amp;iacute;m (Keyboard), Chuột (Mouse) v&amp;agrave; M&amp;aacute;y qu&amp;eacute;t ảnh (Scaner) l&amp;agrave; c&amp;aacute;c thiết bị d&amp;ugrave;ng để cung cấp dữ liệu cho m&amp;aacute;y t&amp;iacute;nh xử l&amp;yacute;.&lt;/p&gt;\r\n',1,'2020-11-01 13:36:02',33,NULL,NULL,1.00000),(702,1,'Hệ điều hành là:','&lt;p&gt;Hệ điều h&amp;agrave;nh l&amp;agrave;:&lt;/p&gt;\r\n','&lt;p&gt;Hệ điều h&amp;agrave;nh l&amp;agrave;&amp;nbsp;một phần mềm chạy tr&amp;ecirc;n m&amp;aacute;y t&amp;iacute;nh, d&amp;ugrave;ng để điều h&amp;agrave;nh, quản l&amp;yacute; c&amp;aacute;c thiết bị phần cứng v&amp;agrave; c&amp;aacute;c t&amp;agrave;i nguy&amp;ecirc;n phần mềm tr&amp;ecirc;n m&amp;aacute;y t&amp;iacute;nh.&lt;/p&gt;\r\n',1,'2020-11-01 13:37:54',33,NULL,NULL,1.00000),(703,1,'Trong bảng tính Excel, giá trị trả về của công thức =LEN(“đề thi tin học văn phòng”) là:','&lt;p&gt;Trong bảng t&amp;iacute;nh Excel, gi&amp;aacute; trị trả về của c&amp;ocirc;ng thức =LEN(&amp;ldquo;đề thi tin học văn ph&amp;ograve;ng&amp;rdquo;) l&amp;agrave;:&lt;/p&gt;\r\n','&lt;p&gt;=LEN(&amp;ldquo;đề thi tin học văn ph&amp;ograve;ng&amp;rdquo;) cho kết quả l&amp;agrave; 24 v&amp;igrave; chiều d&amp;agrave;i của chuỗi&amp;nbsp;&amp;ldquo;đề thi tin học văn ph&amp;ograve;ng&amp;rdquo; l&amp;agrave; 24 k&amp;iacute; tự.&lt;/p&gt;\r\n',1,'2020-11-01 13:39:38',33,NULL,NULL,1.00000),(704,1,'Danh sách các mục chọn trong thực đơn gọi là:','&lt;p&gt;Danh s&amp;aacute;ch c&amp;aacute;c mục chọn trong thực đơn gọi l&amp;agrave;:&lt;/p&gt;\r\n','&lt;p&gt;Danh s&amp;aacute;ch c&amp;aacute;c mục chọn trong thực đơn gọi l&amp;agrave;: Menu bar&lt;/p&gt;\r\n',1,'2020-11-01 13:41:06',33,NULL,NULL,1.00000),(705,1,'Print Screen có công dụng:','&lt;p&gt;Print Screen c&amp;oacute; c&amp;ocirc;ng dụng:&lt;/p&gt;\n','&lt;p&gt;Print Screen c&amp;oacute; c&amp;ocirc;ng dụng: Chụp ảnh m&amp;agrave;n h&amp;igrave;nh hiện h&amp;agrave;nh.&lt;/p&gt;\n',1,'2020-11-01 13:42:39',33,'2020-11-01 14:44:58',33,1.00000),(706,1,'Nếu muốn làm cho cửa sổ nhỏ hơn, bạn nên sử dụng nút:','&lt;p&gt;Nếu muốn l&amp;agrave;m cho cửa sổ nhỏ hơn, bạn n&amp;ecirc;n sử dụng n&amp;uacute;t:&lt;/p&gt;\n','&lt;p&gt;Nếu muốn l&amp;agrave;m cho cửa sổ nhỏ hơn, ta sử dụng n&amp;uacute;t&amp;nbsp;Restore down&lt;/p&gt;\n',1,'2020-11-01 13:44:36',33,'2020-11-01 14:40:56',33,1.00000),(707,1,'Trong soạn thảo Word, công dụng của tổ hợp phím Ctrl – S là:','&lt;p&gt;Trong soạn thảo Word, c&amp;ocirc;ng dụng của tổ hợp ph&amp;iacute;m Ctrl &amp;ndash; S l&amp;agrave;:&lt;/p&gt;\n','&lt;p&gt;Trong soạn thảo Word, c&amp;ocirc;ng dụng của tổ hợp ph&amp;iacute;m Ctrl &amp;ndash; S l&amp;agrave;:&amp;nbsp;Lưu nội dung tập tin văn bản v&amp;agrave;o đĩa.&lt;/p&gt;\n',1,'2020-11-01 13:46:18',33,'2020-11-01 14:40:26',33,1.00000),(708,1,'Trong soạn thảo Word, để chèn các kí tự đặc biệt vào văn bản:','&lt;p&gt;Trong soạn thảo Word, để ch&amp;egrave;n c&amp;aacute;c k&amp;iacute; tự đặc biệt v&amp;agrave;o văn bản:&lt;/p&gt;\r\n','&lt;p&gt;Trong soạn thảo Word, để ch&amp;egrave;n c&amp;aacute;c k&amp;iacute; tự đặc biệt v&amp;agrave;o văn bản:&amp;nbsp;Insert &amp;ndash; Symbol&lt;/p&gt;\r\n',1,'2020-11-01 13:48:25',33,NULL,NULL,1.00000),(709,1,'Trong soạn thảo Word, để kết thúc 1 đoạn và muốn sang 1 đoạn mới:','&lt;p&gt;Trong soạn thảo Word, để kết th&amp;uacute;c 1 đoạn v&amp;agrave; muốn sang 1 đoạn mới:&lt;/p&gt;\n','&lt;p&gt;Trong soạn thảo Word, để kết th&amp;uacute;c 1 đoạn v&amp;agrave; muốn sang 1 đoạn mới:&amp;nbsp;Bấm ph&amp;iacute;m Enter&lt;/p&gt;\n',1,'2020-11-01 13:50:15',33,'2020-11-01 14:41:34',33,1.00000),(710,1,'Trong soạn thảo Word, tổ hợp phím nào cho phép đưa con trỏ về cuối văn bản:','&lt;p&gt;Trong soạn thảo Word, tổ hợp ph&amp;iacute;m n&amp;agrave;o cho ph&amp;eacute;p đưa con trỏ về cuối văn bản:&lt;/p&gt;\r\n','&lt;p&gt;Trong soạn thảo Word, tổ hợp ph&amp;iacute;m cho ph&amp;eacute;p đưa con trỏ về cuối văn bản:&amp;nbsp;Ctrl + End&lt;/p&gt;\r\n',1,'2020-11-01 13:51:53',33,NULL,NULL,1.00000),(711,1,'Để tạo hiệu ứng cho 1 Slide, bạn sử dụng:','&lt;p&gt;Để tạo hiệu ứng cho 1 Slide, bạn sử dụng:&lt;/p&gt;\r\n','&lt;p&gt;Để tạo hiệu ứng cho 1 Slide, bạn sử dụng:&amp;nbsp;Animations -&amp;gt; Add Animation&lt;/p&gt;\r\n',1,'2020-11-01 13:53:21',33,NULL,NULL,1.00000),(712,1,'Trong Powerpoint để tạo mới 1 Slide ta sử dụng:','&lt;p&gt;Trong Powerpoint để tạo mới 1 Slide ta sử dụng:&lt;/p&gt;\r\n','&lt;p&gt;Trong Powerpoint để tạo mới 1 Slide ta sử dụng:&amp;nbsp;Home -&amp;gt; Slides -&amp;gt; New Slide&lt;/p&gt;\r\n',1,'2020-11-01 13:55:20',33,NULL,NULL,1.00000),(713,1,'Trong Powerpoint muốn đánh số trang cho từng Slide ta dùng:','&lt;p&gt;Trong Powerpoint muốn đ&amp;aacute;nh số trang cho từng Slide ta d&amp;ugrave;ng:&lt;/p&gt;\n','&lt;p&gt;Trong Powerpoint muốn đ&amp;aacute;nh số trang cho từng Slide ta d&amp;ugrave;ng:&amp;nbsp;Insert \\ Text \\ Slide Number.&lt;/p&gt;\n',2,'2020-11-01 13:56:37',33,'2020-11-14 13:22:30',33,1.00000),(714,1,'Trong bảng tính Excel, tại ô A2 có giá trị số 25; tại ô B2 gõ...','&lt;p&gt;Trong bảng t&amp;iacute;nh Excel, tại &amp;ocirc; A2 c&amp;oacute; gi&amp;aacute; trị số 25; tại &amp;ocirc; B2 g&amp;otilde; v&amp;agrave;o c&amp;ocirc;ng thức =SQRT(A2) th&amp;igrave; nhận được kết quả:&lt;/p&gt;\n','&lt;p&gt;Trong bảng t&amp;iacute;nh Excel, tại &amp;ocirc; A2 c&amp;oacute; gi&amp;aacute; trị số 25; tại &amp;ocirc; B2 g&amp;otilde; v&amp;agrave;o c&amp;ocirc;ng thức =SQRT(A2) th&amp;igrave; nhận được kết quả: 5&lt;/p&gt;\n',1,'2020-11-01 13:59:32',33,'2020-11-06 13:41:33',33,1.00000),(715,1,'Trong bảng tính Excel, hàm Today() trả về:','&lt;p&gt;Trong bảng t&amp;iacute;nh Excel, h&amp;agrave;m Today() trả về:&lt;/p&gt;\n','&lt;p&gt;Trong bảng t&amp;iacute;nh Excel, h&amp;agrave;m Today() trả về:&amp;nbsp;Ng&amp;agrave;y hiện h&amp;agrave;nh của hệ thống&lt;/p&gt;\n',1,'2020-11-01 14:00:45',33,'2020-11-01 14:37:24',33,1.00000),(716,1,'Các hàm trong excel, hàm nào dùng để tìm kiếm:','&lt;p&gt;C&amp;aacute;c h&amp;agrave;m trong excel, h&amp;agrave;m n&amp;agrave;o d&amp;ugrave;ng để t&amp;igrave;m kiếm:&lt;/p&gt;\r\n','&lt;p&gt;C&amp;aacute;c h&amp;agrave;m trong excel, h&amp;agrave;m&amp;nbsp;d&amp;ugrave;ng để t&amp;igrave;m kiếm: Vlookup&lt;/p&gt;\r\n',1,'2020-11-01 14:02:16',33,NULL,NULL,1.00000),(718,1,'Trong Excel, điều kiện trong hàm IF được phát biểu dưới dạng một phép so sánh. Khi cần so sánh khác nhau, ta sử dụng phép toán?','&lt;p&gt;Trong Excel, điều kiện trong h&amp;agrave;m IF được ph&amp;aacute;t biểu dưới dạng một ph&amp;eacute;p so s&amp;aacute;nh. Khi cần so s&amp;aacute;nh kh&amp;aacute;c nhau, ta sử dụng ph&amp;eacute;p to&amp;aacute;n?&lt;/p&gt;\r\n','&lt;p&gt;&amp;lt;&amp;gt; l&amp;agrave; to&amp;aacute;n tử &amp;quot;kh&amp;aacute;c&amp;quot;, &amp;quot;kh&amp;ocirc;ng bằng nhau&amp;quot; trong Excel&lt;/p&gt;\r\n',1,'2020-11-06 13:26:52',33,NULL,NULL,1.00000),(719,1,'Giả sử tại ô D2 có công thức =B2*C2/100. Nêu sao chép công thức đến ô G6 sẽ có công thức là?','&lt;p&gt;Giả sử tại &amp;ocirc; D2 c&amp;oacute; c&amp;ocirc;ng thức =B2*C2/100. N&amp;ecirc;u sao ch&amp;eacute;p c&amp;ocirc;ng thức đến &amp;ocirc; G6 sẽ c&amp;oacute; c&amp;ocirc;ng thức l&amp;agrave;?&lt;/p&gt;\r\n','&lt;p&gt;Sau khi sao ch&amp;eacute;p ta thực hiện tăng dần thứ tự c&amp;aacute;c &amp;ocirc; ta được E6*F6/100&lt;/p&gt;\r\n',1,'2020-11-06 13:29:14',33,NULL,NULL,1.00000),(720,1,'Nếu trong một ô tính có các kí hiệu #####, điều đó có nghĩa là gì?','&lt;p&gt;Nếu trong một &amp;ocirc; t&amp;iacute;nh c&amp;oacute; c&amp;aacute;c k&amp;iacute; hiệu #####, điều đ&amp;oacute; c&amp;oacute; nghĩa l&amp;agrave; g&amp;igrave;?&lt;/p&gt;\r\n','',1,'2020-11-06 13:31:48',33,NULL,NULL,1.00000),(721,1,'Chọn từ đúng dưới đây để điền vào chỗ trống: “Trăng quầng thì hạn, trăng… thì mưa.”','&lt;p&gt;Chọn từ đ&amp;uacute;ng dưới đ&amp;acirc;y để điền v&amp;agrave;o chỗ trống: &amp;ldquo;Trăng quầng th&amp;igrave; hạn, trăng&amp;hellip; th&amp;igrave; mưa.&amp;rdquo;&lt;/p&gt;\r\n','&lt;p&gt;&amp;ldquo;Trăng quầng th&amp;igrave; hạn, trăng &lt;strong&gt;t&amp;aacute;n&lt;/strong&gt;&amp;nbsp;th&amp;igrave; mưa.&amp;rdquo;&lt;/p&gt;\r\n',1,'2020-11-06 13:40:34',33,NULL,NULL,1.00000),(722,1,'Truyện cổ tích Tấm Cám thể hiện nhiều mối quan hệ. Câu nào bên dưới...','&lt;p&gt;Truyện cổ t&amp;iacute;ch Tấm C&amp;aacute;m thể hiện nhiều mối quan hệ. C&amp;acirc;u n&amp;agrave;o b&amp;ecirc;n dưới đ&amp;acirc;y kh&amp;ocirc;ng thể hiện mối quan hệ ch&amp;iacute;nh?&lt;/p&gt;\r\n','&lt;p&gt;Xuy&amp;ecirc;n suốt truyện cổ t&amp;iacute;ch Tấm C&amp;aacute;m, c&amp;aacute;c mối quan hệ ch&amp;iacute;nh l&amp;agrave;:&lt;/p&gt;\r\n\r\n&lt;p&gt;- Mối quan hệ mẹ ghẻ v&amp;agrave; con chồng.&lt;/p&gt;\r\n\r\n&lt;p&gt;- Mối quan hệ giữa chị v&amp;agrave; em trong gia đ&amp;igrave;nh.&lt;/p&gt;\r\n\r\n&lt;p&gt;- Mối quan hệ giữa c&amp;aacute;i thiện v&amp;agrave; c&amp;aacute;i &amp;aacute;c.&lt;/p&gt;\r\n\r\n&lt;p&gt;- Mối quan hệ giữa vợ v&amp;agrave; chồng.&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n',1,'2020-11-06 13:46:35',33,NULL,NULL,1.00000),(723,1,'. “Thuở trời đất nổi cơn gió bụi/ Khách má hồng nhiều nỗi truân chuyên/...','&lt;p&gt;&amp;ldquo;Thuở trời đất nổi cơn gi&amp;oacute; bụi&lt;/p&gt;\r\n\r\n&lt;p&gt;Kh&amp;aacute;ch m&amp;aacute; hồng nhiều nỗi tru&amp;acirc;n chuy&amp;ecirc;n&lt;/p&gt;\r\n\r\n&lt;p&gt;Xanh kia thăm thẳm từng tr&amp;ecirc;n&lt;/p&gt;\r\n\r\n&lt;p&gt;V&amp;igrave; ai g&amp;acirc;y dựng cho n&amp;ecirc;n nỗi n&amp;agrave;y.&amp;rdquo;&lt;/p&gt;\r\n\r\n&lt;p&gt;(Chinh phụ ng&amp;acirc;m, Đặng Trần C&amp;ocirc;n &amp;ndash; Đo&amp;agrave;n Thị Điểm)&lt;/p&gt;\r\n\r\n&lt;p&gt;Đoạn thơ được viết theo thể thơ:&lt;/p&gt;\r\n','&lt;p&gt;Đoạn thơ tr&amp;ecirc;n gồm c&amp;oacute; 2 c&amp;acirc;u 7 chữ v&amp;agrave; 2 c&amp;acirc;u lục b&amp;aacute;t&lt;/p&gt;\r\n',1,'2020-11-06 13:50:55',33,NULL,NULL,1.00000),(724,1,'“Ngoài song thỏ thẻ oanh vàng Nách tường bông liễu bay sang láng giềng...','&lt;p&gt;&amp;ldquo;Ngo&amp;agrave;i song thỏ thẻ oanh v&amp;agrave;ng&lt;/p&gt;\r\n\r\n&lt;p&gt;N&amp;aacute;ch tường b&amp;ocirc;ng liễu bay sang l&amp;aacute;ng giềng.&amp;rdquo;&lt;/p&gt;\r\n\r\n&lt;p&gt;(Truyện Kiều &amp;ndash; Nguyễn Du)&lt;/p&gt;\r\n\r\n&lt;p&gt;Từ n&amp;agrave;o trong c&amp;acirc;u thơ tr&amp;ecirc;n được d&amp;ugrave;ng với nghĩa chuyển?&lt;/p&gt;\r\n','&lt;p&gt;&amp;quot;N&amp;aacute;ch tường&amp;quot; được d&amp;ugrave;ng với nghĩa chuyển.&lt;/p&gt;\r\n',1,'2020-11-06 13:54:14',33,NULL,NULL,1.00000),(725,1,'Điền vào chỗ trống trong câu thơ: “Đưa người ta không đưa qua sông/ Sao có tiếng…','&lt;p&gt;Điền v&amp;agrave;o chỗ trống trong c&amp;acirc;u thơ: &amp;ldquo;Đưa người ta kh&amp;ocirc;ng đưa qua s&amp;ocirc;ng/ Sao c&amp;oacute; tiếng&amp;hellip; ở trong l&amp;ograve;ng.&amp;rdquo; (Tống biệt h&amp;agrave;nh - Th&amp;acirc;m T&amp;acirc;m)&lt;/p&gt;\r\n','&lt;p&gt;&amp;ldquo;Đưa người ta kh&amp;ocirc;ng đưa qua s&amp;ocirc;ng&lt;/p&gt;\r\n\r\n&lt;p&gt;Sao c&amp;oacute; tiếng s&amp;oacute;ng&amp;nbsp;ở trong l&amp;ograve;ng.&amp;rdquo;&lt;/p&gt;\r\n',1,'2020-11-06 14:11:57',33,NULL,NULL,1.00000),(726,1,'“Anh dắt em qua cầu/ Cởi áo đưa cho nhau/ Nhớ về nhà dối mẹ/ Gió bay rồi...','&lt;p&gt;&amp;ldquo;Anh dắt em qua cầu&lt;/p&gt;\r\n\r\n&lt;p&gt;Cởi &amp;aacute;o đưa cho nhau&lt;/p&gt;\r\n\r\n&lt;p&gt;Nhớ về nh&amp;agrave; dối mẹ&lt;/p&gt;\r\n\r\n&lt;p&gt;Gi&amp;oacute; bay rồi c&amp;ograve;n đ&amp;acirc;u.&amp;rdquo;&lt;/p&gt;\r\n\r\n&lt;p&gt;(L&amp;agrave;ng quan họ, Nguyễn Phan H&amp;aacute;ch).&lt;/p&gt;\r\n\r\n&lt;p&gt;Đoạn thơ tr&amp;ecirc;n thuộc d&amp;ograve;ng thơ:&lt;/p&gt;\r\n','',1,'2020-11-06 14:16:00',33,NULL,NULL,1.00000),(727,1,'Qua tác phẩm Những đứa con trong gia đình, Nguyễn Thi đã thể hiện rõ điều nào dưới đây?','&lt;p&gt;Qua t&amp;aacute;c phẩm Những đứa con trong gia đ&amp;igrave;nh, Nguyễn Thi đ&amp;atilde; thể hiện r&amp;otilde; điều n&amp;agrave;o dưới đ&amp;acirc;y?&lt;/p&gt;\r\n','',1,'2020-11-06 14:19:27',33,NULL,NULL,1.25000),(728,1,'The cutting or replacement of trees downtown _____ arguments recently.','&lt;p&gt;The cutting or replacement of trees downtown _____ arguments recently.&lt;/p&gt;\r\n','&lt;p&gt;The cutting or replacement of trees downtown &lt;strong&gt;has&lt;/strong&gt;&amp;nbsp;arguments recently.&lt;/p&gt;\r\n',1,'2020-11-06 16:04:39',4,NULL,NULL,1.00000),(729,1,'Many places _____ our city are heavily polluted.','&lt;p&gt;Many places _____ our city are heavily polluted.&lt;/p&gt;\r\n','&lt;p&gt;Many places &lt;strong&gt;in&lt;/strong&gt;&amp;nbsp;our city are heavily polluted.&lt;/p&gt;\r\n',1,'2020-11-06 16:05:56',4,NULL,NULL,1.00000),(730,1,'There were so _____ negative comments on Tom’s post that he had...','&lt;p&gt;There were so _____ negative comments on Tom&amp;rsquo;s post that he had to remove it.&lt;/p&gt;\r\n','&lt;p&gt;There were so many&amp;nbsp;negative comments on Tom&amp;rsquo;s post that he had to remove it.&lt;/p&gt;\r\n',1,'2020-11-06 16:07:32',4,NULL,NULL,1.00000),(731,1,'His mother is _____ mine, but he is younger than me.','&lt;p&gt;His mother is _____ mine, but he is younger than me.&lt;/p&gt;\r\n','&lt;p&gt;His mother is older than&amp;nbsp;mine, but he is younger than me.&lt;/p&gt;\r\n',1,'2020-11-06 16:09:06',4,NULL,NULL,1.00000),(732,1,'You’re driving _____! It is really dangerous in this snowy weat...','&lt;p&gt;You&amp;rsquo;re driving _____! It is really dangerous in this snowy weather.&lt;/p&gt;\r\n','&lt;p&gt;You&amp;rsquo;re driving &lt;strong&gt;carelessly&lt;/strong&gt;! It is really dangerous in this snowy weather.&lt;/p&gt;\r\n',1,'2020-11-06 16:32:32',4,NULL,NULL,1.00000),(733,1,'You’re driving _____! It is really dangerous in this snowy weat...','&lt;p&gt;You&amp;rsquo;re driving _____! It is really dangerous in this snowy weather.&lt;/p&gt;\r\n','&lt;p&gt;You&amp;rsquo;re driving &lt;strong&gt;carelessly&lt;/strong&gt;! It is really dangerous in this snowy weather.&lt;/p&gt;\r\n',1,'2020-11-06 17:11:29',33,NULL,NULL,1.00000),(734,1,'You’re driving _____! It is really dangerous in this snowy weat...','&lt;p&gt;You&amp;rsquo;re driving _____! It is really dangerous in this snowy weather.&lt;/p&gt;\r\n','&lt;p&gt;You&amp;rsquo;re driving &lt;strong&gt;carelessly&lt;/strong&gt;! It is really dangerous in this snowy weather.&lt;/p&gt;\r\n',1,'2020-11-06 17:11:39',33,NULL,NULL,1.00000),(735,1,'You’re driving _____! It is really dangerous in this snowy weat...','&lt;p&gt;You&amp;rsquo;re driving _____! It is really dangerous in this snowy weather.&lt;/p&gt;\r\n','&lt;p&gt;You&amp;rsquo;re driving &lt;strong&gt;carelessly&lt;/strong&gt;! It is really dangerous in this snowy weather.&lt;/p&gt;\r\n',1,'2020-11-06 17:11:59',33,NULL,NULL,1.00000),(736,1,'You’re driving _____! It is really dangerous in this snowy weat...','&lt;p&gt;You&amp;rsquo;re driving _____! It is really dangerous in this snowy weather.&lt;/p&gt;\r\n','&lt;p&gt;You&amp;rsquo;re driving &lt;strong&gt;carelessly&lt;/strong&gt;! It is really dangerous in this snowy weather.&lt;/p&gt;\r\n',1,'2020-11-06 17:12:08',33,NULL,NULL,1.00000),(737,1,'There were too many participants in the event, so each of ...','&lt;p&gt;There were too many participants in the event, so each of them were asked just one question.&lt;/p&gt;\r\n','&lt;p&gt;There were too many participants in the event, so each of them were asked just one question.&lt;/p&gt;\r\n',1,'2020-11-06 17:14:04',4,NULL,NULL,1.00000),(738,1,'Which of the following is true of the EIGRP successor route?...','&lt;p&gt;Which of the following is true of the EIGRP successor route? (Select two.)&lt;/p&gt;\r\n','&lt;p&gt;Successor routes are used to forward traffic to the destination network because those routes are stored in the routing table. The successor route may have a backup route known as a feasible successor route.&lt;/p&gt;\r\n',2,'2020-11-14 15:27:52',63,NULL,NULL,1.00000),(739,1,'Which of the following describes a successor route?','&lt;p&gt;Which of the following describes a successor route?&lt;/p&gt;\n','&lt;p&gt;A successor route is a primary route stored in the routing table. Know that the feasible successor route is a backup route stored in the topology table.&lt;/p&gt;\n',1,'2020-11-14 15:28:40',63,'2020-11-15 14:49:41',63,1.00000),(740,1,'Which of the following does EIGRP use as its metrics by default?...','&lt;p&gt;Which of the following does EIGRP use as its metrics by default? (Select two.)&lt;/p&gt;\n','&lt;p&gt;By default, EIGRP uses bandwidth and delay to calculate its metrics.&lt;/p&gt;\n',2,'2020-11-14 15:29:46',63,'2020-11-15 16:07:41',63,1.00000),(741,1,'Which of the following are true regarding successor routes?...','&lt;p&gt;Which of the following are true regarding successor routes? (Select three.)&lt;/p&gt;\n','&lt;p&gt;Successor routes have backup routes known as feasible successor routes and are stored in the routing table (as well as the topology table). Because the successor route is stored in the routing table, it is used to forward traffic to the destination network.&lt;/p&gt;\n',2,'2020-11-14 15:30:54',63,'2020-11-15 16:11:23',3,3.00000),(742,1,'What does an EIGRP router do if its successor route is active but there is no feasible...','&lt;p&gt;What does an EIGRP router do if its successor route is active but there is no feasible successor route?&lt;/p&gt;\r\n','&lt;p&gt;The EIGRP router will send a multicast query to all adjacent neighbors, asking for available routes to the destination network.&lt;/p&gt;\r\n',1,'2020-11-14 15:31:41',63,NULL,NULL,1.00000),(743,1,'When looking at the EIGRP topology, what code is used to indicate that there are no ...','&lt;p&gt;When looking at the EIGRP topology, what code is used to indicate that there are no changes in the EIGRP topology?&lt;/p&gt;\n','&lt;p&gt;When looking at the topology table, you can see a status on the left side for each route. If the status displays passive, that is a good thing because it means there have been not changes to the route.&lt;/p&gt;\n',2,'2020-11-14 16:33:20',63,'2020-11-15 16:11:44',3,1.00000),(744,1,'You have started the EIGRP process. What command would you use to enable EIGRP ...','&lt;p&gt;You have started the EIGRP process. What command would you use to enable EIGRP for network 172.16.16.0/20?&lt;/p&gt;\r\n','&lt;p&gt;Another example wildcard question for you! When adding networks to EIGRP, you use the network command with the network ID and then the wildcard mask &amp;ndash; not the subnet mask! The quickest method to calculate the wildcard mask is to take the subnet mask away from 255.255.255.255. For example:&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp; &amp;nbsp;255.255.255.255&lt;/p&gt;\r\n\r\n&lt;p&gt;-&amp;nbsp; 255.255.240.0&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;mdash;&amp;mdash;&amp;mdash;&amp;mdash;&amp;mdash;&amp;mdash;&amp;mdash;&amp;mdash;&lt;/p&gt;\r\n\r\n&lt;p&gt;&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; 0. 0.15.255&lt;/p&gt;\r\n',1,'2020-11-14 16:40:19',63,NULL,NULL,1.00000),(745,1,'You are troubleshooting EIGRP. What commands could you use to view the autonomous system number?...','&lt;p&gt;You are troubleshooting EIGRP. What commands could you use to view the autonomous system number? (Select two.)&lt;/p&gt;\n','&lt;p&gt;You can see the AS number on routers running EIGRP by using the &lt;tt&gt;show ip protocols&lt;/tt&gt; command or the &lt;tt&gt;show ip eigrp topology&lt;/tt&gt; command.&lt;/p&gt;\n',2,'2020-11-14 16:41:36',63,'2020-11-15 15:43:19',63,2.00000),(746,1,'Looking at the figure below, how long does it take router R1 to send an EIGRP...','&lt;p&gt;Looking at the figure below, how long does it take router R1 to send an EIGRP packet to its neighbor and receive a reply?&lt;/p&gt;\r\n','&lt;p&gt;Looking at the figure, you can see that the Smooth Round Trip Time (SRTT) to R1&amp;rsquo;s neighbor is 40 ms. This is the time it takes for a message to be sent to the neighbor and a reply to come back.&lt;/p&gt;\r\n',1,'2020-11-14 16:42:41',63,NULL,NULL,1.00000),(747,1,'What command was used in the figure below to display the output?','&lt;p&gt;What command was used in the figure below to display the output?&lt;/p&gt;\n\n&lt;p&gt;&lt;tt&gt;Routing Protocol is &amp;quot;eigrp 10 &amp;quot;&lt;br /&gt;\n&amp;nbsp; Outgoing update filter list for all interfaces is not set &lt;/tt&gt;&lt;br /&gt;\n&lt;tt&gt;&amp;nbsp; Incoming update filter list for all interfaces is not set &lt;/tt&gt;&lt;br /&gt;\n&lt;tt&gt;&amp;nbsp; Default networks flagged in outgoing updates &lt;/tt&gt;&lt;br /&gt;\n&lt;tt&gt;&amp;nbsp; Default networks accepted from incoming updates &lt;/tt&gt;&lt;br /&gt;\n&lt;tt&gt;&amp;nbsp; EIGRP metric weight Kl=l, K2=0, K3=l, K4=0, K5=0 &lt;/tt&gt;&lt;br /&gt;\n&lt;tt&gt;&amp;nbsp; EIGRP maximum hopcount 100 &lt;/tt&gt;&lt;br /&gt;\n&lt;tt&gt;&amp;nbsp; EIGRP maximum metric variance 1&lt;/tt&gt;&lt;br /&gt;\n&lt;tt&gt;Redistributing: eigrp 10&lt;/tt&gt;&lt;br /&gt;\n&lt;tt&gt;Automatic network summarization is in effect&lt;/tt&gt;&lt;br /&gt;\n&lt;tt&gt;Automatic address summarization:&lt;/tt&gt;&lt;br /&gt;\n&lt;tt&gt;Maximum path: 4&lt;/tt&gt;&lt;br /&gt;\n&lt;tt&gt;Routing for Networks:&lt;/tt&gt;&lt;br /&gt;\n&lt;tt&gt;&amp;nbsp; 11.0.0.0&lt;/tt&gt;&lt;br /&gt;\n&lt;tt&gt;&amp;nbsp; 12.0.0.0&lt;/tt&gt;&lt;br /&gt;\n&lt;tt&gt;Routing information Sources:&lt;/tt&gt;&lt;br /&gt;\n&lt;tt&gt;&amp;nbsp; Gateway&amp;nbsp;&amp;nbsp; &amp;nbsp;Distance&amp;nbsp;&amp;nbsp; &amp;nbsp;Last update&lt;/tt&gt;&lt;br /&gt;\n&lt;tt&gt;&amp;nbsp; 12.0.0.2&amp;nbsp;&amp;nbsp; &amp;nbsp;90&amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp; &amp;nbsp;99622&lt;/tt&gt;&lt;br /&gt;\n&lt;tt&gt;Distance: internal 90 external 170&lt;/tt&gt;&lt;/p&gt;\n','&lt;p&gt;The show ip protocols command was used in the figure and displays details about the routing protocol, such as the protocol, autonomous system, and the networks that the protocol was enabled on.&lt;/p&gt;\n',1,'2020-11-14 16:44:30',63,'2020-11-14 18:14:53',63,1.00000),(748,1,'Which statement is true for EIGRP but not for EIGRPv6?','&lt;p&gt;Which statement is true for EIGRP but not for EIGRPv6?&lt;/p&gt;\r\n','&lt;p&gt;Interfaces for EIGRP must be on the same subnet for an adjacency to form. However, that is not a requirement for EIGRPv6.&lt;/p&gt;\r\n',1,'2020-11-14 16:51:22',63,NULL,NULL,1.00000),(749,1,'You need to calculate a variance for EIGRPv6. Which table will allow you to calculate the...','&lt;p&gt;You need to calculate a variance for EIGRPv6. Which table will allow you to calculate the variance for unequal-cost load balancing?&lt;/p&gt;\n','&lt;p&gt;The command &lt;tt&gt;show ipv6 eigrp topology&lt;/tt&gt; will allow you to verify the metrics. From this, you can calculate the variance multiplier for unequal-cost load balancing.&lt;/p&gt;\n',1,'2020-11-14 17:04:00',63,'2020-11-14 18:12:33',63,1.00000),(750,1,'In the following exhibit, a host on the 2001:db8:0500::/64 network sends a packet to a host on the 2001:db8:3000::/64 network...','&lt;p&gt;In the following exhibit, a host on the 2001:db8:0500::/64 network sends a packet to a host on the 2001:db8:3000::/64 network. Which path will the packet take?&lt;/p&gt;\n\n&lt;p&gt;&lt;img src=&quot;/publics/users/images/image(2).png&quot; style=&quot;height:208px; width:500px&quot; /&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;tt&gt;&lt;strong&gt;RouterA#&lt;/strong&gt;show ipv6 eigrp topology&lt;br /&gt;\n[Output Cut)&lt;br /&gt;\nP 2001 :DB8:1000:764,1 successors, FD is 2816&lt;br /&gt;\n&amp;nbsp; via Connected. GigabitEthernetO/O&lt;br /&gt;\nP 2001:0B8:1500:764,1 successors, FD is 2169856&lt;br /&gt;\n&amp;nbsp; via Connected, Serial0/3/0&lt;br /&gt;\nP 2001:DB8:2000:764,1 successors. FD is 3072&lt;br /&gt;\n&amp;nbsp; via FE80::201:96FF:FE6B:B301 (3072/2816), GigabilEthernetO/O&lt;br /&gt;\n&amp;nbsp; via FE80::201:96FF:FE6B:B301 (2170112/2816). Serial0/3/0&lt;br /&gt;\nP 2001:088:2500:764,1 successors, FD is 2170112&lt;br /&gt;\n&amp;nbsp; via FE80::201:96FF:FE6B:B301 (2170112/2169856), GigabitEthernetO/O&lt;br /&gt;\n&amp;nbsp; via FE80::201:96FF:FE6B:B301 (2681856/2169856), SerialO/3/O&lt;br /&gt;\nP 2001:DB8:3000::/64,1 successors, FD is 2170368&lt;br /&gt;\n&amp;nbsp; via FE80::201;96FF:FE6B:B301 (2170368/2170112), GigabitEthernetO/O&lt;br /&gt;\n&amp;nbsp; via FE80::201:96FF:FE6B:B301 (2682112/2170112), Serial0/3/0&lt;br /&gt;\n&lt;strong&gt;RouterA#&lt;/strong&gt;&lt;/tt&gt;&lt;/p&gt;\n','&lt;p&gt;The packets will take the path of Router A to Switch A to Switch B to Router B, since the feasible distance is lower, by taking the path of the switches. Although interface Gi0/0 on Router A and Gi0/0 on Router B are not in the same subnet, the link-local interfaces are used for routing the packets.&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n',1,'2020-11-14 17:09:13',63,'2020-11-14 18:11:48',63,1.00000),(751,1,'In the following exhibit, how can you force packets from hosts on the 2001:db8:0500::/64 network destined to the...','&lt;p&gt;In the following exhibit, how can you force packets from hosts on the 2001:db8:0500::/64 network destined to the 2001:db8:3000::/64 network through Serial 0/3/0 statically?&lt;/p&gt;\n\n&lt;p&gt;&lt;img src=&quot;/publics/users/images/image(3).png&quot; style=&quot;height:212px; width:500px&quot; /&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;tt&gt;&lt;strong&gt;RouterA#&lt;/strong&gt;show ipv6 eigrp topology&lt;br /&gt;\n[Output Cut]&lt;br /&gt;\nP 2001 :DB8:1000::/64,1 successors, FD is 2816&lt;br /&gt;\n&amp;nbsp; &amp;nbsp;via Connected. GigabitEthernetO/O&lt;br /&gt;\nP 2001:DB8:1500::/64,1 successors, FD is 2169856&lt;br /&gt;\n&amp;nbsp; &amp;nbsp;via Connected, Serial0/3/0&lt;br /&gt;\nP 2001:DB8:2000::/64,1 successors. FD is 3072&lt;br /&gt;\n&amp;nbsp; &amp;nbsp;via FE80&amp;ldquo;201:96FF:FE6B:B301 (3072/2816), GigabitEthernetO/O&lt;br /&gt;\n&amp;nbsp; &amp;nbsp;via FE80::201:96FF:FE6B:B301 (2170112/2816), Serial0/3/0&lt;br /&gt;\nP 2001 :DB8:2500::/64,1 successors, FD is 2170112&lt;br /&gt;\n&amp;nbsp; &amp;nbsp;via FE80&amp;rdquo;201:96FF:FE6B:B301 (2170112/2169856), GigabitEthernetO/O&lt;br /&gt;\n&amp;nbsp; &amp;nbsp;via FE80::201:96FF:FE6B:B301 (2681856/2169856), SeriaIO/3/O&lt;br /&gt;\nP 2001:DB8:3000::/64,1 successors. FD is 2170368&lt;br /&gt;\n&amp;nbsp; &amp;nbsp;via FE80::201:96FF:FE6B:B301 (2170368/2170112), GigabitEthernetO/O&lt;br /&gt;\n&amp;nbsp; &amp;nbsp;via FE8O::2O1:96FF:FE6B:B301 (2682112/2170112). SerialO/3/O&lt;br /&gt;\n&lt;strong&gt;RouterA#&lt;/strong&gt;&lt;/tt&gt;&lt;/p&gt;\n','&lt;p&gt;By configuring the command &lt;tt&gt;passive-interface gi 0/0&lt;/tt&gt; in each router instance, you can prohibit the two routers from creating an adjacency across the Ethernet link. This will not hinder the advertisement of networks attached to the interface as long as the command&lt;tt&gt; ipv6 eigrp 10&amp;rdquo;&lt;/tt&gt; is configured on the interfaces.&lt;/p&gt;\n',1,'2020-11-14 17:19:14',63,'2020-11-14 18:11:24',63,1.00000),(752,1,'Which command will allow you to inspect the K metrics for EIGRP?','&lt;p&gt;Which command will allow you to inspect the K metrics for EIGRP?&lt;/p&gt;\n','&lt;p&gt;The command &lt;tt&gt;show ip protocols&lt;/tt&gt; will allow you to see specifics about the configured routing protocols. In the details of the output will be the K metrics for EIGRP.&lt;/p&gt;\n',1,'2020-11-14 17:25:04',63,'2020-11-14 18:09:54',63,1.00000),(753,1,'You need to suppress EIGRP hello advertisements on the interface connecting you to your ISP...','&lt;p&gt;You need to suppress EIGRP hello advertisements on the interface connecting you to your ISP. Which command will suppress EIGRP hello packets?&lt;/p&gt;\n','&lt;p&gt;The command &lt;tt&gt;passive-interface serial 0/0&lt;/tt&gt; configured inside the router process for EIGRP will set the Serial 0/0 as a passive interface. This will suppress EIGRP hello packets exiting the interface.&lt;/p&gt;\n',1,'2020-11-14 17:29:59',63,'2020-11-14 18:09:15',63,1.00000),(754,1,'You want to confirm a Feasible-Successor route for EIGRP. Which command will allow you to verify this?','&lt;p&gt;You want to confirm a Feasible-Successor route for EIGRP. Which command will allow you to verify this?&lt;/p&gt;\n','&lt;p&gt;The command &lt;tt&gt;show ip eigrp topology&lt;/tt&gt; will allow you to see the calculated metrics for routes inside of the EIGRP topology table. For each network, the number of successors will be displayed. This information will help verify a feasible successor for a particular network.&lt;/p&gt;\n',1,'2020-11-14 17:33:16',63,'2020-11-14 18:08:19',63,1.00000),(755,1,'You have two paths you want to load-balance that have slightly different delays...','&lt;p&gt;You have two paths you want to load-balance that have slightly different delays. Which command will allow you to tune the unequal paths so they will load-balance with EIGRP?&lt;/p&gt;\n','&lt;p&gt;The &lt;tt&gt;variance&lt;/tt&gt; command is configured in the router instance of EIGRP. The command &lt;tt&gt;variance 2&lt;/tt&gt; configures the router variance with a multiplier of 2.&lt;/p&gt;\n',1,'2020-11-14 17:35:56',63,'2020-11-14 18:06:51',63,1.00000),(756,1,'When is the command no passive-interface serial 0/0 used with EIGRP?','&lt;p&gt;When is the command no passive-interface serial 0/0 used with EIGRP?&lt;/p&gt;\n','&lt;p&gt;The command &lt;tt&gt;no passive-interface serial 0/0&lt;/tt&gt; is used when either &lt;tt&gt;passive-interface serial 0/0&lt;/tt&gt; or &lt;tt&gt;passive-interface default&lt;/tt&gt; has been used in the router instance.&lt;/p&gt;\n',1,'2020-11-14 17:37:46',63,'2020-11-14 18:04:38',63,1.00000),(757,1,'In the following exhibit, Router A will not form an EIGRP adjacency with Router B...','&lt;p&gt;In the following exhibit, Router A will not form an EIGRP adjacency with Router B. What is the problem?&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img src=&quot;/publics/users/images/image(4).png&quot; style=&quot;height:256px; width:600px&quot; /&gt;&lt;/p&gt;\r\n','&lt;p&gt;The K metrics must match to allow Router A and Router B to form an adjacency. Router A has a K metric of K2=0 and Router B has a K metric of K2=1.&lt;/p&gt;\r\n',1,'2020-11-14 17:40:42',63,NULL,NULL,1.00000),(758,1,'In the following exhibit, which route will the packet from 192.168.1.5 to 192.168.4.9 take?','&lt;p&gt;In the following exhibit, which route will the packet from 192.168.1.5 to 192.168.4.9 take?&lt;/p&gt;\n\n&lt;p&gt;&lt;img src=&quot;/publics/users/images/image(5).png&quot; style=&quot;height:246px; width:500px&quot; /&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;tt&gt;&lt;strong&gt;RouterA#&lt;/strong&gt;sh ip route&lt;br /&gt;\n[output cut]&lt;br /&gt;\n&amp;nbsp; &amp;nbsp; 192.168.1.0/24 is variably subnetted. 2 subnets. 2 masks&lt;br /&gt;\nC 192.168.1.0/24 is directly connected. GigabitEthernetO/O&lt;br /&gt;\nL 192.168.1.1/32 is directly connected. GigabitEthernetO/O&lt;br /&gt;\n&amp;nbsp; &amp;nbsp;192.168.2.0/24 is variably subnetted. 5 subnets. 2 masks&lt;br /&gt;\nC 192.168.2.0/30 is directly connected. Serial0/3/0&lt;br /&gt;\nL&amp;nbsp;&amp;nbsp; &amp;nbsp;192.168.2.1/32 is directly connected. Serial0/3/0&lt;br /&gt;\nC 192.168.2.4/30 is directly connected. SerialO/3/1&lt;br /&gt;\nL 192.168.2.5/32 is directly connected. SerialO/3/1&lt;br /&gt;\nD&amp;nbsp;&amp;nbsp; &amp;nbsp;192.168.2.8/30 [90/2681856] via 192.168.2.6. 00:32:41, SerialO/3/1&lt;br /&gt;\nD&amp;nbsp;&amp;nbsp; &amp;nbsp;192.168.4.0/24 [90/2682112] via 192.168.2.6. 00:06:12, SerialO/3/1&lt;br /&gt;\n&lt;strong&gt;Router A#&lt;/strong&gt;&lt;/tt&gt;&lt;/p&gt;\n\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\n','&lt;p&gt;The routing table shows a path on Router A to 192.168.4.0/24 via 192.168.2.6. The IP address is configured on Router C, therefore the path will be Router A to Router C to Router B to the destination network.&lt;/p&gt;\n',1,'2020-11-14 17:44:47',63,'2020-11-14 18:02:49',63,1.00000),(759,1,'267. In the following exhibit, EIGRP is used to advertise routes on both Router A and Router B...','&lt;p&gt;In the following exhibit, EIGRP is used to advertise routes on both Router A and Router B. Why will packets not route from 172.16.2.0/24 to 172.16.4.0/24?&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;img src=&quot;/publics/users/images/image(6).png&quot; style=&quot;height:190px; width:500px&quot; /&gt;&lt;/p&gt;\r\n','&lt;p&gt;Auto-summarization is configured by default with EIGRP. Since there are several networks in the 172.16.0.0/22 address range on Router A, they will be summarized. On Router B there is the network 172.16.4.0/24, which would be part of the summarization of the 172.16.0.0/22 network. Since the serial connection is a noncontiguous network, auto-summarization will prohibit proper routing operation.&lt;/p&gt;\r\n',1,'2020-11-14 17:48:28',63,NULL,NULL,1.00000),(760,1,'Which mechanism in EIGRP allows for EIGRP to support multiple protocols?','&lt;p&gt;Which mechanism in EIGRP allows for EIGRP to support multiple protocols?&lt;/p&gt;\r\n','&lt;p&gt;The protocol-dependent module (PDM) allows for multiple protocols to be supported with EIGRP. This allows for the same algorithm and methodology to be applied and for PDM-compliant modules such as IPv6, IP, and IPX to be used.&lt;/p&gt;\r\n',1,'2020-11-14 17:51:48',63,NULL,NULL,1.00000),(761,1,'Two routers, Router A and Router B, will not form an adjacency with EIGRP...','&lt;p&gt;Two routers, Router A and Router B, will not form an adjacency with EIGRP. You discover that someone configured a custom K metric. Which command will configure the router&amp;rsquo;s K metrics back to their default setting?&lt;/p&gt;\n','&lt;p&gt;The command to configure the K metrics back to their default setting is &lt;code&gt;no metric weights&lt;/code&gt;. This command should be entered in the router instance. The default metrics are K1=1, K2=0, K3=1, K4=0, K5=0.&lt;/p&gt;\n',1,'2020-11-14 17:53:53',63,'2020-11-14 18:01:58',63,1.00000),(762,2,'Which command will allow you to verify the routes advertised by EIGRP?','&lt;p&gt;Which command will allow you to verify the routes advertised by EIGRP?&lt;/p&gt;\r\n','&lt;p&gt;The command &lt;tt&gt;show ip protocols&lt;/tt&gt; will display the networks that are being advertised on the current router.&lt;/p&gt;\r\n',1,'2020-11-15 14:36:21',63,NULL,NULL,1.00000),(763,2,'Which routing protocol supports transport protocols of IP, IPX, and Appletalk?','&lt;p&gt;Which routing protocol supports transport protocols of IP, IPX, and Appletalk?&lt;/p&gt;\r\n','&lt;p&gt;Only EIGRP provides support for all three listed protocols.&lt;/p&gt;\r\n',1,'2020-11-15 14:38:31',63,NULL,NULL,1.00000),(764,2,'You have configured multiple routing protocols on your network. There is a path discovered to a remote networ...','&lt;p&gt;You have configured multiple routing protocols on your network. There is a path discovered to a remote network segment by each routing protocol. Which protocol&amp;#39;s path will be chosen by your router?&lt;/p&gt;\r\n','&lt;p&gt;This is based on the default administrative distance for each of the routing protocols, which leads to the believability of the routing information. Routing protocols have these administrative distances: OSPF (110), IGRP (100), EIGRP internal (90), and RIP (120). In this case, the protocol offering the lowest distance is EIGRP.&lt;/p&gt;\r\n',1,'2020-11-15 14:39:36',63,NULL,NULL,1.00000);
