  `grademethod` tinyint(1) NOT NULL DEFAULT '1',
  `review` tinyint(1) NOT NULL DEFAULT '1',
  `questionsperpage` int NOT NULL DEFAULT '1',
  `suffleanswer` tinyint(1) NOT NULL DEFAULT '0',
  `sufflequestion` tinyint(1) NOT NULL DEFAULT '0',
  `timecreated` datetime DEFAULT NULL,
  `createdby` int DEFAULT NULL,
  `timemodified` datetime DEFAULT NULL,
  `modifiedby` int DEFAULT NULL,
  `password` varchar(32) DEFAULT NULL,
  `showdetails` tinyint DEFAULT '0',
  `navmethod` tinyint DEFAULT NULL,
  `acceptguest` tinyint(1) NOT NULL DEFAULT '0',
  `visible` tinyint(1) NOT NULL DEFAULT '1',
  PRIMARY KEY (`id`),
  UNIQUE KEY `code` (`code`),
  KEY `category` (`category`),
  KEY `createdby` (`createdby`),
  KEY `modifiedby` (`modifiedby`),
  CONSTRAINT `quiz_ibfk_1` FOREIGN KEY (`category`) REFERENCES `categories` (`id`),
  CONSTRAINT `quiz_ibfk_2` FOREIGN KEY (`createdby`) REFERENCES `users` (`id`),
  CONSTRAINT `quiz_ibfk_3` FOREIGN KEY (`modifiedby`) REFERENCES `users` (`id`)
) ENGINE=InnoDB AUTO_INCREMENT=32 DEFAULT CHARSET=utf8;
