INSERT INTO `quiz` VALUES (1,2,'647364','Các thiết bị giao tiếp mạng, các dịch vụ mạng, so sánh và đối chiếu các loại mô hình Topology của hệ thống mạng','Các thiết bị giao tiếp mạng, các dịch vụ mạng, so sánh và đối chiếu các loại mô hình Topology của hệ thống mạng','2020-10-02 00:04:35','2020-10-09 15:19:40',3600,1,3,5,1,10,1,1,'2020-06-22 13:50:34',3,'2020-09-22 13:50:34',3,NULL,1,1,1,1),(2,2,'7zgz1h0p','OSI Model and Network Layer 1-4 (Part 1)','Cáp mạng, chia mạng con, mô hình OSI và các tiêu chuẩn mạng.',NULL,NULL,3600,1,3,1,2,10,1,1,'2020-06-30 11:27:03',63,NULL,NULL,NULL,1,1,1,1),(3,2,'qulpaw04','OSI Model and Network Layer 1-4 (Part 2)','Cáp mạng, chia mạng con, mô hình OSI và các tiêu chuẩn mạng.',NULL,NULL,2100,1,3,1,1,10,1,1,'2020-06-30 11:27:03',3,NULL,NULL,NULL,1,1,1,1),(4,2,'lqevmymh','OSI Model and Network Layer 1-4 (Part 3)','Chọn loại cáp thích hợp dựa trên các yêu cầu triển khai mô hình mạng, các loại địa chỉ IPv4 - sự cần thiết của lớp địa chỉ ip private, định cấu hình, xác minh và khắc phục sự cố địa chỉ IPv4 và mạng con.',NULL,NULL,2700,1,3,1,1,10,1,1,'2020-06-30 11:27:03',3,NULL,NULL,NULL,1,1,1,1),(5,2,'81z7kqbc','OSI Model and Network Layer 1-4 (Part 4)','Chọn loại cáp thích hợp dựa trên các yêu cầu triển khai mô hình mạng, các loại địa chỉ IPv4 - sự cần thiết của lớp địa chỉ ip private, định cấu hình, xác minh và khắc phục sự cố địa chỉ IPv4 và mạng con.',NULL,NULL,2700,1,3,1,1,10,1,1,'2020-06-30 11:27:03',3,NULL,NULL,NULL,1,1,1,1),(6,2,'4jbo21u3','Compare and contrast OSI and TCP/IP models','So sánh và đối chiếu hai mô hình OSI và TCP/IP.',NULL,NULL,2100,1,3,1,1,10,1,1,'2020-06-30 11:27:03',3,NULL,NULL,NULL,1,1,1,1),(7,2,'rhtonf6h','IP Addressing','Định địa chỉ IP và xử lý sự cố địa chỉ IP.',NULL,NULL,3000,1,3,1,1,10,1,1,'2020-06-30 11:27:03',3,NULL,NULL,NULL,1,1,1,0),(8,2,'vta036fb','TCP/IP protocols and ports','Các giao thức và các cổng của TCP/IP, so sánh UDP và TCP.',NULL,NULL,2100,1,3,1,1,10,1,1,'2020-06-30 11:27:03',3,NULL,NULL,NULL,1