INSERT INTO `setting` VALUES (1,'Website luyện thi trắc nghiệm - Đồ án môn học NT208.L11.MMCL','Lorem ipsum dolor sit amet, consectetur adipisicing elit. Consectetur dolores ea excepturi, facilis, fuga ipsum itaque, maxime quaerat quam repellendus rerum sapiente velit veniam voluptas voluptatibus. Consequuntur nam possimus sunt?','CONTACT US','Liên hệ ngay để nhận những bộ đề chất lượng','Website luyện thi trắc nghiệm','Đồ án môn học Lập trình ứng dụng Web - NT208.L11.MMCL','Pham Tran Tien Dat & Le Dang Dung','Website luyện thi trắc nghiệm, đồ án môn học Lập trình ứng dụng Web.','Trường ĐH Công nghệ thông tin - ĐHQG TP.HCM, Khu phố 6, phường Linh Trung, quận Thủ Đức, TP,HCM','(+84) 934 993 860 & (+84) 363 789 095','18520585@gm.uit.edu.vn & 18520633@gm.uit.edu.vn','&lt;p&gt;Trang web thi trắc nghiệm &lt;a href=&quot;http://nt208.phamtrantiendat.online&quot;&gt;nt208.phamtrantiendat.online&lt;/a&gt;&amp;nbsp;chuy&amp;ecirc;n cung cấp miễn ph&amp;iacute; c&amp;aacute;c đề thi trắc nghiệm về lĩnh vực ngoại ngữ&amp;nbsp;v&amp;agrave; c&amp;ocirc;ng nghệ th&amp;ocirc;ng tin d&amp;agrave;nh nhằm phục vụ mục đ&amp;iacute;ch v&amp;agrave; nhu cầu học tập v&amp;agrave; nghi&amp;ecirc;n cứu d&amp;agrave;nh cho mọi người.&lt;/p&gt;\n\n&lt;p&gt;Với những chức năng cho ph&amp;eacute;p người d&amp;ugrave;ng c&amp;oacute; thể tạo đề v&amp;agrave; cho người kh&amp;aacute;c l&amp;agrave;m ph&amp;ugrave; hợp với qu&amp;aacute; tr&amp;igrave;nh học online đồng thời cho ph&amp;eacute;p người l&amp;agrave;m b&amp;agrave;i được xem điểm số v&amp;agrave; kết quả sau khi ho&amp;agrave;n th&amp;agrave;nh b&amp;agrave;i thi, kết quả được gửi qua mail gi&amp;uacute;p cho người d&amp;ugrave;ng lưu trữ được điểm số của m&amp;igrave;nh v&amp;agrave; so s&amp;aacute;nh với những lần sau để đ&amp;aacute;nh gi&amp;aacute; tr&amp;igrave;nh độ những lần l&amp;agrave;m b&amp;agrave;i kh&amp;aacute;c nhau.&lt;/p&gt;\n','&lt;h3&gt;C&amp;acirc;u hỏi thường gặp:&lt;/h3&gt;\n\n&lt;p&gt;&lt;em&gt;&lt;strong&gt;L&amp;agrave;m thế n&amp;agrave;o để tạo đề thi cho ri&amp;ecirc;ng m&amp;igrave;nh ?&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;\n\n&lt;p&gt;- Sau khi đăng nhập, bạn tiến h&amp;agrave;nh chọn Bảng điều khiển tr&amp;ecirc;n Thanh c&amp;ocirc;ng cụ &amp;gt; Đề thi của t&amp;ocirc;i &amp;gt; Tạo đề thi mới. Tại đ&amp;acirc;y một hộp thoại sẽ hướng dẫn bạn tạo Đề thi mới cho ri&amp;ecirc;ng m&amp;igrave;nh.&lt;/p&gt;\n\n&lt;p&gt;&lt;em&gt;&lt;strong&gt;C&amp;aacute;c c&amp;acirc;u hỏi của t&amp;ocirc;i sau khi tạo được lưu ở đ&amp;acirc;u ?&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;\n\n&lt;p&gt;- Sau khi tạo, c&amp;acirc;u hỏi của bạn sẽ được lưu trưc tại Ng&amp;acirc;n h&amp;agrave;ng c&amp;acirc;u hỏi của ri&amp;ecirc;ng bạn.&lt;/p&gt;\n\n&lt;p&gt;&lt;em&gt;&lt;strong&gt;Người kh&amp;aacute;c c&amp;oacute; thể l&amp;agrave;m b&amp;agrave;i tr&amp;ecirc;n đề thi của t&amp;ocirc;i đ&amp;atilde; tạo&amp;nbsp;hay kh&amp;ocirc;ng ?&lt;/strong&gt;&lt;/em&gt;&lt;/p&gt;\n\n&lt;p&gt;- V&amp;acirc;ng điều đ&amp;oacute; l&amp;agrave; c&amp;oacute; thể, bạn chỉ cần chia sẻ m&amp;atilde; đề thi của m&amp;igrave;nh cho người kh&amp;aacute;c, họ sẽ c&amp;oacute; thể truy cập để thực hiện đề thi của bạn.&lt;/p&gt;\n\n&lt;h3&gt;Li&amp;ecirc;n hệ:&lt;/h3&gt;\n\n&lt;p&gt;&lt;strong&gt;&lt;em&gt;Khi cần hỗ trợ t&amp;ocirc;i c&amp;oacute; thể li&amp;ecirc;n hệ với ai ?&lt;/em&gt;&lt;/strong&gt;&lt;/p&gt;\n\n&lt;p&gt;- Khi cần hỗ trợ bạn c&amp;oacute; thể li&amp;ecirc;n hệ với:&lt;/p&gt;\n\n&lt;p&gt;&lt;a href=&quot;https://www.facebook.com/phamtrantiendat/&quot;&gt;Phạm Trần Tiến Đạt&lt;/a&gt; - &lt;a href=&quot;mailto:18520585@gm.uit.edu.vn&quot;&gt;18520585@gm.uit.edu.vn&lt;/a&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;a href=&quot;tel:(+84) 934 993 860&quot;&gt;(+84) 934 993 860&lt;/a&gt;&lt;/p&gt;\n\n&lt;p&gt;&lt;a href=&quot;https://www.facebook.com/LEDUNGUIT&quot;&gt;L&amp;ecirc; Đăng Dũng&lt;/a&gt; - &lt;a href=&quot;mailto:18520633@gm.uit.edu.vn&quot;&gt;18520633@gm.uit.edu.vn&lt;/a&gt;&lt;br /&gt;\n&lt;a href=&quot;tel:(+84) 363 789 095&quot;&gt;(+84) 363 789 095&lt;/a&gt;&lt;/p&gt;\n','https://www.facebook.com/LEDUNGUIT','https://www.instagram.com/pttd.dat/','http://twitter.com');
